        \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442 \u00ab\u041c\u0418\u042d\u0422\u00bb":1,"\u041d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u044b\u0439
        \u0438\u0441\u0441\u043b\u0435\u0434\u043e\u0432\u0430\u0442\u0435\u043b\u044c\u0441\u043a\u0438\u0439
        \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442 \"\u041c\u042d\u0418\"":1,"\u041d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u044b\u0439
        \u0438\u0441\u0441\u043b\u0435\u0434\u043e\u0432\u0430\u0442\u0435\u043b\u044c\u0441\u043a\u0438\u0439
        \u0422\u043e\u043c\u0441\u043a\u0438\u0439 \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439
        \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442":1,"\u041d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u044b\u0439
        \u0438\u0441\u0441\u043b\u0435\u0434\u043e\u0432\u0430\u0442\u0435\u043b\u044c\u0441\u043a\u0438\u0439
        \u041c\u043e\u0441\u043a\u043e\u0432\u0441\u043a\u0438\u0439 \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439
        \u0441\u0442\u0440\u043e\u0438\u0442\u0435\u043b\u044c\u043d\u044b\u0439 \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442\"
        (\u041d\u0418\u0423 \u041c\u0413\u0421\u0423)":1,"\u041d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u044b\u0439
        \u0438\u0441\u0441\u043b\u0435\u0434\u043e\u0432\u0430\u0442\u0435\u043b\u044c\u0441\u043a\u0438\u0439
        \u041c\u043e\u0440\u0434\u043e\u0432\u0441\u043a\u0438\u0439 \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439
        \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442 \u0438\u043c\u0435\u043d\u0438
        \u041d.\u041f.\u041e\u0433\u0430\u0440\u0435\u0432\u0430":1,"\u041d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u044b\u0439
        \u0438\u0441\u0441\u043b\u0435\u0434\u043e\u0432\u0430\u0442\u0435\u043b\u044c\u0441\u043a\u0438\u0439
        \u041c\u043e\u0440\u0434\u043e\u0432\u0441\u043a\u0438\u0439 \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439
        \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442 \u0438\u043c\u0435\u043d\u0438
        \u041d.\u041f. \u041e\u0433\u0430\u0440\u0435\u0432\u0430":1,"\u041d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u044b\u0439
        \u0438\u0441\u0441\u043b\u0435\u0434\u043e\u0432\u0430\u0442\u0435\u043b\u044c\u0441\u043a\u0438\u0439
        \u041c\u043e\u0440\u0434\u043e\u0432\u0441\u043a\u0438\u0439 \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439
        \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442 \u0438\u043c.
        \u041d.\u041f. \u041e\u0433\u0430\u0440\u0435\u0432\u0430":1,"\u041d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u044b\u0439
        \u0418\u0441\u0441\u043b\u0435\u0434\u043e\u0432\u0430\u0442\u0435\u043b\u044c\u0441\u043a\u0438\u0439
        \u0423\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442 \u0412\u044b\u0441\u0448\u0430\u044f
        \u0428\u043a\u043e\u043b\u0430 \u042d\u043a\u043e\u043d\u043e\u043c\u0438\u043a\u0438":1,"\u041d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u044b\u0439
        \u0418\u0441\u0441\u043b\u0435\u0434\u043e\u0432\u0430\u0442\u0435\u043b\u044c\u0441\u043a\u0438\u0439
        \u041c\u043e\u0440\u0434\u043e\u0432\u0441\u043a\u0438\u0439 \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439
        \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442 \u0438\u043c.
        \u041d.\u041f. \u041e\u0433\u0430\u0440\u0451\u0432\u0430":1,"\u041d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u043e-\u0438\u0441\u0441\u043b\u0435\u0434\u043e\u0432\u0430\u0442\u0435\u043b\u044c\u0441\u043a\u0438\u0439
        \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442 \u00ab\u041c\u042d\u0418\u00bb":1,"\u041d\u0430\u0443\u0447\u043d\u044b\u0439
        \u0446\u0435\u043d\u0442\u0440 \u0441\u043e\u0446\u0438\u0430\u043b\u044c\u043d\u043e-\u044d\u043a\u043e\u043d\u043e\u043c\u0438\u0447\u0435\u0441\u043a\u043e\u0433\u043e
        \u043c\u043e\u043d\u0438\u0442\u043e\u0440\u0438\u043d\u0433\u0430":1,"\u041d\u0430\u0443\u0447\u043d\u043e-\u043f\u0440\u043e\u0438\u0437\u0432\u043e\u0434\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0435
        \u043e\u0431\u044a\u0435\u0434\u0438\u043d\u0435\u043d\u0438\u0435 \"\u0414\u043e\u043c
        \u0424\u0430\u0440\u043c\u0430\u0446\u0438\u0438\"":1,"\u041d\u0430\u0443\u0447\u043d\u043e-\u0432\u043d\u0435\u0434\u0440\u0435\u043d\u0447\u0435\u0441\u043a\u0438\u0439
        \u0446\u0435\u043d\u0442\u0440 \u00ab\u0410\u0433\u0440\u043e\u0432\u0435\u0442\u0437\u0430\u0449\u0438\u0442\u0430\u00bb":1,"\u041d\u0430\u0443\u043a\u043e\u0432\u043e-\u0442\u0435\u0445\u043d\u0456\u0447\u043d\u0430
        \u0431\u0456\u0431\u043b\u0456\u043e\u0442\u0435\u043a\u0430 \u0456\u043c.
        \u0413.\u0406. \u0414\u0435\u043d\u0438\u0441\u0435\u043d\u043a\u0430 \u041d\u0430\u0446\u0456\u043e\u043d\u0430\u043b\u044c\u043d\u043e\u0433\u043e
        \u0442\u0435\u0445\u043d\u0456\u0447\u043d\u043e\u0433\u043e \u0443\u043d\u0456\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442\u0443
        \u0423\u043a\u0440\u0430\u0457\u043d\u0438 \u00ab\u041a\u0438\u0457\u0432\u0441\u044c\u043a\u0438\u0439
        \u043f\u043e\u043b\u0456\u0442\u0435\u0445\u043d\u0456\u0447\u043d\u0438\u0439
        \u0456\u043dc\u0442\u0438\u0442\u0443\u0442 \u0456\u043c\u0435\u043d\u0456
        \u0406\u0433\u043e\u0440\u044f \u0421\u0456\u043a\u043e\u0440\u0441\u044c\u043a\u043e\u0433\u043e\u00bb":1,"\u041d\u0430\u0443\u043a\u043e\u0432\u0430
        \u0431\u0456\u0431\u043b\u0456\u043e\u0442\u0435\u043a\u0430 \u041d\u0430\u0446\u0456\u043e\u043d\u0430\u043b\u044c\u043d\u043e\u0433\u043e
        \u0443\u043d\u0456\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442\u0443\u041a\u0438\u0454\u0432\u043e-\u041c\u043e\u0433\u0438\u043b\u044f\u043d\u0441\u044c\u043a\u0430
        \u0430\u043a\u0430\u0434\u0435\u043c\u0456\u044f":1,"\u041d\u0422\u0426 \u00ab\u041e\u041f\u0422\u0418\u041c\u00bb":1,"\u041d\u0418\u0426
        \u0424\u0413\u0411\u0423 \u00ab48 \u0426\u041d\u0418\u0418\u00bb \u041c\u0438\u043d\u043e\u0431\u043e\u0440\u043e\u043d\u044b
        \u0420\u043e\u0441\u0441\u0438\u0438":1,"\u041d\u0418\u0423 \u041c\u043e\u0441\u043a\u043e\u0432\u0441\u043a\u0438\u0439
        \u044d\u043d\u0435\u0440\u0433\u0435\u0442\u0438\u0447\u0435\u0441\u043a\u0438\u0439
        \u0438\u043d\u0441\u0442\u0438\u0442\u0443\u0442":1,"\u041d\u0418\u0423 \u0412\u0428\u042d
        \u2014 \u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433":1,"\u041d\u0418\u0423
        \"\u041c\u042d\u0418\"":1,"\u041d\u0418\u0423 \"\u0412\u044b\u0441\u0448\u0430\u044f
        \u0448\u043a\u043e\u043b\u0430 \u044d\u043a\u043e\u043d\u043e\u043c\u0438\u043a\u0438\"":1,"\u041d\u0418\u0418
        \u0424\u0421\u0418\u041d \u0420\u043e\u0441\u0441\u0438\u0438":1,"\u041c\u0443\u043d\u0438\u0446\u0438\u043f\u0430\u043b\u044c\u043d\u043e\u0435
        \u0431\u044e\u0434\u0436\u0435\u0442\u043d\u043e\u0435 \u0443\u0447\u0440\u0435\u0436\u0434\u0435\u043d\u0438\u0435
        \u0434\u043e\u043f\u043e\u043b\u043d\u0438\u0442\u0435\u043b\u044c\u043d\u043e\u0433\u043e
        \u043e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u043d\u0438\u044f \u00ab\u0414\u0435\u0442\u0441\u043a\u0430\u044f
        \u0448\u043a\u043e\u043b\u0430 \u0438\u0441\u043a\u0443\u0441\u0441\u0442\u0432
        \u21161\u00bb":1,"\u041c\u043e\u0441\u043a\u043e\u0432\u0441\u043a\u0438\u0439
        \u0444\u0438\u043d\u0430\u043d\u0441\u043e\u0432\u043e-\u044e\u0440\u0438\u0434\u0438\u0447\u0435\u0441\u043a\u0438\u0439
        \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442 \u041c\u0424\u042e\u0410":1,"\u041c\u043e\u0441\u043a\u043e\u0432\u0441\u043a\u0438\u0439
        \u0444\u0438\u0437\u0438\u043a\u043e-\u0442\u0435\u0445\u043d\u0438\u0447\u0435\u0441\u043a\u0438\u0439
        \u0438\u043d\u0441\u0442\u0438\u0442\u0443\u0442 (\u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439
        \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442)":1,"\u041c\u043e\u0441\u043a\u043e\u0432\u0441\u043a\u0438\u0439
        \u0444\u0438\u0437\u0438\u043a\u043e-\u0442\u0435\u0445\u043d\u0438\u0447\u0435\u0441\u043a\u0438\u0439
        \u0438\u043d\u0441\u0442\u0438\u0442\u0443\u0442":1,"\u041c\u043e\u0441\u043a\u043e\u0432\u0441\u043a\u0438\u0439
        \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442 \u0438\u043c.
        \u0421.\u042e. \u0412\u0438\u0442\u0442\u0435":1,"\u041c\u043e\u0441\u043a\u043e\u0432\u0441\u043a\u0438\u0439
        \u0442\u0435\u0445\u043d\u043e\u043b\u043e\u0433\u0438\u0447\u0435\u0441\u043a\u0438\u0439
        \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442":1,"\u041c\u043e\u0441\u043a\u043e\u0432\u0441\u043a\u0438\u0439
        \u0442\u0435\u0445\u043d\u043e\u043b\u043e\u0433\u0438\u0447\u0435\u0441\u043a\u0438\u0439
        \u043a\u043e\u043b\u043b\u0435\u0434\u0436":1,"\u041c\u043e\u0441\u043a\u043e\u0432\u0441\u043a\u0438\u0439
        \u0442\u0435\u0445\u043d\u0438\u0447\u0435\u0441\u043a\u0438\u0439 \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442
        \u0441\u0432\u044f\u0437\u0438 \u0438 \u0438\u043d\u0444\u043e\u0440\u043c\u0430\u0442\u0438\u043a\u0438":1,"\u041c\u043e\u0441\u043a\u043e\u0432\u0441\u043a\u0438\u0439
        \u043f\u0441\u0438\u0445\u043e\u043b\u043e\u0433\u043e-\u0441\u043e\u0446\u0438\u0430\u043b\u044c\u043d\u044b\u0439
        \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442":1,"\u041c\u043e\u0441\u043a\u043e\u0432\u0441\u043a\u0438\u0439
        \u043c\u0435\u0436\u0434\u0443\u043d\u0430\u0440\u043e\u0434\u043d\u044b\u0439
        \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442":1,"\u041c\u043e\u0441\u043a\u043e\u0432\u0441\u043a\u0438\u0439
        \u0433\u0443\u043c\u0430\u043d\u0438\u0442\u0430\u0440\u043d\u044b\u0439 \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442":1,"\u041c\u043e\u0441\u043a\u043e\u0432\u0441\u043a\u0438\u0439
        \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439
        \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442 \u0438\u043c\u0435\u043d\u0438
        \u041c.\u0412. \u041b\u043e\u043c\u043e\u043d\u043e\u0441\u043e\u0432\u0430,
        \u0421\u043e\u0446\u0438\u043e\u043b\u043e\u0433\u0438\u0447\u0435\u0441\u043a\u0438\u0439
        \u0444\u0430\u043a\u0443\u043b\u044c\u0442\u0435\u0442":1,"\u041c\u043e\u0441\u043a\u043e\u0432\u0441\u043a\u0438\u0439
        \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439
        \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442 \u0434\u0438\u0437\u0430\u0439\u043d\u0430
        \u0438 \u0442\u0435\u0445\u043d\u043e\u043b\u043e\u0433\u0438\u0438":1,"\u041c\u043e\u0441\u043a\u043e\u0432\u0441\u043a\u0438\u0439
        \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439
        \u0442\u0435\u0445\u043d\u0438\u0447\u0435\u0441\u043a\u0438\u0439 \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442
        \u0438\u043c\u0435\u043d\u0438 \u041d.\u042d. \u0411\u0430\u0443\u043c\u0430\u043d\u0430":1,"\u041c\u043e\u0441\u043a\u043e\u0432\u0441\u043a\u0438\u0439
        \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439
        \u0442\u0435\u0445\u043d\u0438\u0447\u0435\u0441\u043a\u0438\u0439 \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442
        \u0438\u043c. \u041d.\u042d. \u0411\u0430\u0443\u043c\u0430\u043d\u0430 (\u043d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u044b\u0439
        \u0438\u0441\u0441\u043b\u0435\u0434\u043e\u0432\u0430\u0442\u0435\u043b\u044c\u0441\u043a\u0438\u0439
        \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442)":1,"\u041c\u043e\u0441\u043a\u043e\u0432\u0441\u043a\u0438\u0439
        \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439
        \u043f\u0441\u0438\u0445\u043e\u043b\u043e\u0433\u043e-\u043f\u0435\u0434\u0430\u0433\u043e\u0433\u0438\u0447\u0435\u0441\u043a\u0438\u0439
        \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442":1,"\u041c\u043e\u0441\u043a\u043e\u0432\u0441\u043a\u0438\u0439
        \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439
