        \"\u0426\u041e-\u0433\u0438\u043c\u043d\u0430\u0437\u0438\u044f \u211630\"":1,"\u041c\u0410\u0423
        \"\u0421\u041f \u2116 12\"":1,"\u041c\u0410\u041e\u0423 \u043b\u0438\u0446\u0435\u0439
        \u211678 \u0438\u043c. \u0410. \u0421. \u041f\u0443\u0448\u043a\u0438\u043d\u0430":1,"\u041c\u0410\u041e\u0423
        \u00ab\u041c\u043d\u043e\u0433\u043e\u043f\u0440\u043e\u0444\u0438\u043b\u044c\u043d\u044b\u0439
        \u043b\u0438\u0446\u0435\u0439 \u2116 148 \u0433. \u0427\u0435\u043b\u044f\u0431\u0438\u043d\u0441\u043a\u0430\u00bb":1,"\u041b\u0443\u0433\u0430\u043d\u0441\u043a\u0438\u0439
