        \u041e\u0441\u0442\u0440\u043e\u0433\u0440\u0430\u0434\u0441\u044c\u043a\u043e\u0433\u043e":1,"\u041a\u0440\u0435\u043c\u0435\u043d\u0447\u0443\u0446\u044c\u043a\u0438\u0439
        \u043b\u044c\u043e\u0442\u043d\u0438\u0439 \u043a\u043e\u043b\u0435\u0434\u0436
        \u0425\u0430\u0440\u043a\u0456\u0432\u0441\u044c\u043a\u043e\u0433\u043e \u043d\u0430\u0446\u0456\u043e\u043d\u0430\u043b\u044c\u043d\u043e\u0433\u043e
        \u0443\u043d\u0456\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442\u0443 \u0432\u043d\u0443\u0442\u0440\u0456\u0448\u043d\u0456\u0445
        \u0441\u043f\u0440\u0430\u0432, Ukraine":1,"\u041a\u0440\u0435\u043c\u0435\u043d\u0447\u0443\u0446\u044c\u043a\u0438\u0439  \u0456\u043d\u0441\u0442\u0438\u0442\u0443\u0442  \u0412\u041d\u0417
