        \u041d\u043e\u0431\u0435\u043b\u044f\u00bb, Ukraine":1,"\u041a\u0440\u0430\u0441\u043d\u043e\u044f\u0440\u0441\u043a\u0438\u0439\u2002\u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439\u2002\u043c\u0435\u0434\u0438\u0446\u0438\u043d\u0441\u043a\u0438\u0439\u2002\u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442\u2002\u0438\u043c.\u2002\u043f\u0440\u043e\u0444.\u2002\u0412.\u0424.\u2002\u0412\u043e\u0439\u043d\u043e-\u042f\u0441\u0435\u043d\u0435\u0446\u043a\u043e\u0433\u043e":1,"\u041a\u0440\u0430\u0441\u043d\u043e\u044f\u0440\u0441\u043a\u0438\u0439
        \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439
        \u043c\u0435\u0434\u0438\u0446\u0438\u043d\u0441\u043a\u0438\u0439 \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442
        \u0438\u043c. \u043f\u0440\u043e\u0444. \u0412.\u0424.\u0412\u043e\u0439\u043d\u043e\u2010\u042f\u0441\u0435\u043d\u0435\u0446\u043a\u043e\u0433\u043e":1,"\u041a\u043e\u0441\u0442\u0440\u043e\u043c\u0441\u043a\u043e\u0439
        \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439
        \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442":1,"\u041a\u043e\u043c\u043c\u0443\u043d\u0430\u043b\u044c\u043d\u043e\u0435
        \u0443\u043d\u0438\u0442\u0430\u0440\u043d\u043e\u0435 \u043f\u0440\u0435\u0434\u043f\u0440\u0438\u044f\u0442\u0438\u0435
        \u00ab\u0411\u0440\u0435\u0441\u0442\u0436\u0438\u043b\u0441\u0442\u0440\u043e\u0439\u00bb":1,"\u041a\u043e\u043c\u0438
        \u0440\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430\u043d\u0441\u043a\u0430\u044f
        \u0430\u043a\u0430\u0434\u0435\u043c\u0438\u044f \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0439
        \u0441\u043b\u0443\u0436\u0431\u044b \u0438 \u0443\u043f\u0440\u0430\u0432\u043b\u0435\u043d\u0438\u044f":1,"\u041a\u0438\u0440\u043e\u0432\u0441\u043a\u0438\u0439
        \u0438\u043d\u0441\u0442\u0438\u0442\u0443\u0442 \u043f\u043e\u0432\u044b\u0448\u0435\u043d\u0438\u044f
        \u043a\u0432\u0430\u043b\u0438\u0444\u0438\u043a\u0430\u0446\u0438\u0438 \u0440\u0430\u0431\u043e\u0442\u043d\u0438\u043a\u043e\u0432
        \u0424\u0421\u0418\u041d \u0420\u043e\u0441\u0441\u0438\u0438":1,"\u041a\u0438\u0440\u043e\u0432\u0441\u043a\u0438\u0439
        \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439
        \u043c\u0435\u0434\u0438\u0446\u0438\u043d\u0441\u043a\u0438\u0439 \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442":1,"\u041a\u0435\u043c\u0435\u0440\u043e\u0432\u0441\u043a\u0438\u0439
        \u0438\u043d\u0441\u0442\u0438\u0442\u0443\u0442 (\u0444\u0438\u043b\u0438\u0430\u043b)
        \u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0433\u043e \u044d\u043a\u043e\u043d\u043e\u043c\u0438\u0447\u0435\u0441\u043a\u043e\u0433\u043e
        \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442\u0430 \u0438\u043c.
        \u0413.\u0412.\u041f\u043b\u0435\u0445\u0430\u043d\u043e\u0432\u0430":1,"\u041a\u0430\u0440\u0448\u0438\u043d\u0441\u043a\u0438\u0439
        \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439
        \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442":1,"\u041a\u0430\u043b\u0443\u0436\u0441\u043a\u0438\u0439
        \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439
        \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442 \u0438\u043c.
        \u041a.\u042d. \u0426\u0438\u043e\u043b\u043a\u043e\u0432\u0441\u043a\u043e\u0433\u043e":1,"\u041a\u0430\u0437\u0430\u043d\u0441\u043a\u0438\u0439
        \u0444\u0435\u0434\u0435\u0440\u0430\u043b\u044c\u043d\u044b\u0439 \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442":1,"\u041a\u0430\u0437\u0430\u043d\u0441\u043a\u0438\u0439
        \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439
        \u044d\u043d\u0435\u0440\u0433\u0435\u0442\u0438\u0447\u0435\u0441\u043a\u0438\u0439
        \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442":1,"\u041a\u0430\u0437\u0430\u043d\u0441\u043a\u0438\u0439
        \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439
        \u043c\u0435\u0434\u0438\u0446\u0438\u043d\u0441\u043a\u0438\u0439 \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442":1,"\u041a\u0430\u0437\u0430\u043d\u0441\u043a\u0438\u0439
        \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439
        \u0430\u0440\u0445\u0438\u0442\u0435\u043a\u0442\u0443\u0440\u043d\u043e-\u0441\u0442\u0440\u043e\u0438\u0442\u0435\u043b\u044c\u043d\u044b\u0439
        \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442":1,"\u041a\u0430\u0437\u0430\u043d\u0441\u043a\u0438\u0439
        (\u041f\u0440\u0438\u0432\u043e\u043b\u0436\u0441\u043a\u0438\u0439) \u0444\u0435\u0434\u0435\u0440\u0430\u043b\u044c\u043d\u044b\u0439
        \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442":1,"\u041a\u0430\u0431\u0430\u0440\u0434\u0438\u043d\u043e-\u0411\u0430\u043b\u043a\u0430\u0440\u0441\u043a\u0438\u0439
        \u043d\u0430\u0443\u0447\u043d\u044b\u0439 \u0446\u0435\u043d\u0442\u0440
        \u0420\u0410\u041d":1,"\u041a\u0424\u0423 \u041c\u0435\u0434\u0438\u0446\u0438\u043d\u0441\u043a\u0430\u044f
        \u0430\u043a\u0430\u0434\u0435\u043c\u0438\u044f":1,"\u0418\u0441\u0441\u043b\u0435\u0434\u043e\u0432\u0430\u0442\u0435\u043b\u044c\u0441\u043a\u0438\u0439
        \u041c\u043e\u0440\u0434\u043e\u0432\u0441\u043a\u0438\u0439 \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439
        \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442 \u0438\u043c.
        \u041d.\u041f. \u041e\u0433\u0430\u0440\u0451\u0432\u0430":1,"\u0418\u0440\u043a\u0443\u0442\u0441\u043a\u0438\u0439
        \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439
        \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442":1,"\u0418\u0440\u043a\u0443\u0442\u0441\u043a\u0438\u0439
        \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439
        \u043c\u0435\u0434\u0438\u0446\u0438\u043d\u0441\u043a\u0438\u0439 \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442":1,"\u0418\u0440\u043a\u0443\u0442\u0441\u043a\u0438\u0439
        \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439
        \u0430\u0433\u0440\u0430\u0440\u043d\u044b\u0439 \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442
        \u0438\u043c\u0435\u043d\u0438 \u0410.\u0410. \u0415\u0436\u0435\u0432\u0441\u043a\u043e\u0433\u043e":1,"\u0418\u043d\u0441\u0442\u0438\u0442\u0443\u0442
        \u044d\u0442\u043d\u043e\u043b\u043e\u0433\u0438\u0438 \u0438 \u0430\u043d\u0442\u0440\u043e\u043f\u043e\u043b\u043e\u0433\u0438\u0438
        \u0438\u043c. \u041d.\u041d. \u041c\u0438\u043a\u043b\u0443\u0445\u043e-\u041c\u0430\u043a\u043b\u0430\u044f
        \u0420\u0410\u041d":1,"\u0418\u043d\u0441\u0442\u0438\u0442\u0443\u0442 \u044d\u043b\u0435\u043c\u0435\u043d\u0442\u043e\u043e\u0440\u0433\u0430\u043d\u0438\u0447\u0435\u0441\u043a\u0438\u0445
        \u0441\u043e\u0435\u0434\u0438\u043d\u0435\u043d\u0438\u0439 \u0438\u043c.
        \u0410.\u041d. \u041d\u0435\u0441\u043c\u0435\u044f\u043d\u043e\u0432\u0430
        \u0420\u0410\u041d":1,"\u0418\u043d\u0441\u0442\u0438\u0442\u0443\u0442 \u0445\u0438\u043c\u0438\u0438
        \u0414\u0430\u043b\u044c\u043d\u0435\u0432\u043e\u0441\u0442\u043e\u0447\u043d\u043e\u0433\u043e
        \u043e\u0442\u0434\u0435\u043b\u0435\u043d\u0438\u044f \u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0439
        \u0430\u043a\u0430\u0434\u0435\u043c\u0438\u0438 \u043d\u0430\u0443\u043a":1,"\u0418\u043d\u0441\u0442\u0438\u0442\u0443\u0442
        \u0445\u0438\u043c\u0438\u0438 \u0414\u0430\u043b\u044c\u043d\u0435\u0432\u043e\u0441\u0442\u043e\u0447\u043d\u043e\u0433\u043e
        \u041e\u0442\u0434\u0435\u043b\u0435\u043d\u0438\u044f \u0420\u0410\u041d":1,"\u0418\u043d\u0441\u0442\u0438\u0442\u0443\u0442
        \u0445\u0438\u043c\u0438\u0438 \u0414\u0412\u041e \u0420\u0410\u041d":1,"\u0418\u043d\u0441\u0442\u0438\u0442\u0443\u0442
        \u0442\u0435\u043e\u0440\u0435\u0442\u0438\u0447\u0435\u0441\u043a\u043e\u0439
        \u0438 \u043f\u0440\u0438\u043a\u043b\u0430\u0434\u043d\u043e\u0439 \u043c\u0435\u0445\u0430\u043d\u0438\u043a\u0438
        \u0438\u043c. \u0421.\u0410. \u0425\u0440\u0438\u0441\u0442\u0438\u0430\u043d\u043e\u0432\u0438\u0447\u0430
        \u0421\u041e \u0420\u0410\u041d":1,"\u0418\u043d\u0441\u0442\u0438\u0442\u0443\u0442
        \u0441\u0442\u0440\u0430\u0442\u0435\u0433\u0438\u0438 \u0440\u0430\u0437\u0432\u0438\u0442\u0438\u044f
        \u043e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u043d\u0438\u044f \u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0439
        \u0430\u043a\u0430\u0434\u0435\u043c\u0438\u0438  \u043e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u043d\u0438\u044f":1,"\u0418\u043d\u0441\u0442\u0438\u0442\u0443\u0442
        \u0441\u0442\u0440\u0430\u0442\u0435\u0433\u0438\u0438 \u0440\u0430\u0437\u0432\u0438\u0442\u0438\u044f
        \u043e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u043d\u0438\u044f \u0420\u0410\u041e":1,"\u0418\u043d\u0441\u0442\u0438\u0442\u0443\u0442
        \u0441\u0438\u0441\u0442\u0435\u043c \u0438\u043d\u0444\u043e\u0440\u043c\u0430\u0442\u0438\u043a\u0438
        \u0438\u043c. \u0410.\u041f. \u0415\u0440\u0448\u043e\u0432\u0430 \u0421\u041e
        \u0420\u0410\u041d":1,"\u0418\u043d\u0441\u0442\u0438\u0442\u0443\u0442 \u0441\u0435\u043b\u044c\u0441\u043a\u043e\u0433\u043e
        \u0445\u043e\u0437\u044f\u0439\u0441\u0442\u0432\u0430 \u041a\u0440\u044b\u043c\u0430":1,"\u0418\u043d\u0441\u0442\u0438\u0442\u0443\u0442
        \u0440\u0443\u0441\u0441\u043a\u043e\u0433\u043e \u044f\u0437\u044b\u043a\u0430
        \u0438\u043c. \u0412.\u0412. \u0412\u0438\u043d\u043e\u0433\u0440\u0430\u0434\u043e\u0432\u0430
        \u0420\u0410\u041d":1,"\u0418\u043d\u0441\u0442\u0438\u0442\u0443\u0442 \u0440\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0439
        \u0438\u0441\u0442\u043e\u0440\u0438\u0438 \u0420\u0410\u041d":1,"\u0418\u043d\u0441\u0442\u0438\u0442\u0443\u0442
        \u0440\u0430\u0437\u0432\u0438\u0442\u0438\u044f \u043e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u043d\u0438\u044f":1,"\u0418\u043d\u0441\u0442\u0438\u0442\u0443\u0442
        \u043f\u0441\u0438\u0445\u043e\u043b\u043e\u0433\u0438\u0438 \u0438\u043c.
        \u041b.\u0421.\u0412\u044b\u0433\u043e\u0442\u0441\u043a\u043e\u0433\u043e
        \u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0433\u043e \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0433\u043e
        \u0433\u0443\u043c\u0430\u043d\u0438\u0442\u0430\u0440\u043d\u043e\u0433\u043e
        \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442\u0430":1,"\u0418\u043d\u0441\u0442\u0438\u0442\u0443\u0442
        \u043f\u0440\u043e\u0431\u043b\u0435\u043c \u0443\u043f\u0440\u0430\u0432\u043b\u0435\u043d\u0438\u044f
        \u0438\u043c. \u0412. \u0410. \u0422\u0440\u0430\u043f\u0435\u0437\u043d\u0438\u043a\u043e\u0432\u0430
        \u0420\u0410\u041d":1,"\u0418\u043d\u0441\u0442\u0438\u0442\u0443\u0442 \u043f\u0440\u043e\u0431\u043b\u0435\u043c
        \u0443\u043f\u0440\u0430\u0432\u043b\u0435\u043d\u0438\u044f \u0420\u0410\u041d":1,"\u0418\u043d\u0441\u0442\u0438\u0442\u0443\u0442
        \u043f\u043e\u0432\u044b\u0448\u0435\u043d\u0438\u044f \u043a\u0432\u0430\u043b\u0438\u0444\u0438\u043a\u0430\u0446\u0438\u0438
        \u0438 \u043f\u0435\u0440\u0435\u043f\u043e\u0434\u0433\u043e\u0442\u043e\u0432\u043a\u0438
        \u043a\u0430\u0434\u0440\u043e\u0432":1,"\u0418\u043d\u0441\u0442\u0438\u0442\u0443\u0442
        \u043f\u043e\u0432\u044b\u0448\u0435\u043d\u0438\u044f \u043a\u0432\u0430\u043b\u0438\u0444\u0438\u043a\u0430\u0446\u0438\u0438
        \u00ab\u0412\u044b\u0441\u0448\u0438\u0435 \u043a\u0443\u0440\u0441\u044b
        \u0438\u043d\u043e\u0441\u0442\u0440\u0430\u043d\u043d\u044b\u0445 \u044f\u0437\u044b\u043a\u043e\u0432
        \u041c\u0438\u043d\u0438\u0441\u0442\u0435\u0440\u0441\u0442\u0432\u0430 \u0438\u043d\u043e\u0441\u0442\u0440\u0430\u043d\u043d\u044b\u0445
        \u0434\u0435\u043b \u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0439
        \u0424\u0435\u0434\u0435\u0440\u0430\u0446\u0438\u0438\u00bb":1,"\u0418\u043d\u0441\u0442\u0438\u0442\u0443\u0442
        \u043d\u0430\u0440\u043e\u0434\u043d\u043e\u0445\u043e\u0437\u044f\u0439\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0433\u043e
        \u043f\u0440\u043e\u0433\u043d\u043e\u0437\u0438\u0440\u043e\u0432\u0430\u043d\u0438\u044f
        \u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0439 \u0410\u043a\u0430\u0434\u0435\u043c\u0438\u0438
        \u043d\u0430\u0443\u043a":1,"\u0418\u043d\u0441\u0442\u0438\u0442\u0443\u0442
        \u043c\u0435\u0436\u043a\u0443\u043b\u044c\u0442\u0443\u0440\u043d\u043e\u0439
        \u043a\u043e\u043c\u043c\u0443\u043d\u0438\u043a\u0430\u0446\u0438\u0438 \u0438
        \u043c\u0435\u0436\u0434\u0443\u043d\u0430\u0440\u043e\u0434\u043d\u044b\u0445
        \u043e\u0442\u043d\u043e\u0448\u0435\u043d\u0438\u0439 \u0411\u0435\u043b\u0433\u043e\u0440\u043e\u0434\u0441\u043a\u043e\u0433\u043e
        \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0433\u043e
        \u043d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u043e\u0433\u043e
        \u0438\u0441\u0441\u043b\u0435\u0434\u043e\u0432\u0430\u0442\u0435\u043b\u044c\u0441\u043a\u043e\u0433\u043e
        \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442\u0430":1,"\u0418\u043d\u0441\u0442\u0438\u0442\u0443\u0442
        \u043c\u0435\u0436\u0434\u0443\u043d\u0430\u0440\u043e\u0434\u043d\u043e\u0433\u043e
        \u043f\u0440\u0430\u0432\u0430 \u0438 \u044d\u043a\u043e\u043d\u043e\u043c\u0438\u043a\u0438
        \u0438\u043c. \u0410.\u0421. \u0413\u0440\u0438\u0431\u043e\u0435\u0434\u043e\u0432\u0430":1,"\u0418\u043d\u0441\u0442\u0438\u0442\u0443\u0442
        \u043c\u0430\u0448\u0438\u043d\u043e\u0432\u0435\u0434\u0435\u043d\u0438\u044f
        \u0438\u043c. \u0410.\u0410. \u0411\u043b\u0430\u0433\u043e\u043d\u0440\u0430\u0432\u043e\u0432\u0430
        \u0420\u0410\u041d":1,"\u0418\u043d\u0441\u0442\u0438\u0442\u0443\u0442 \u043a\u0430\u0442\u0430\u043b\u0438\u0437\u0430
        \u0438\u043c. \u0413.\u041a. \u0411\u043e\u0440\u0435\u0441\u043a\u043e\u0432\u0430
        \u0421\u041e \u0420\u0410\u041d":1,"\u0418\u043d\u0441\u0442\u0438\u0442\u0443\u0442
        \u0438\u0441\u0442\u043e\u0440\u0438\u0438, \u0430\u0440\u0445\u0435\u043e\u043b\u043e\u0433\u0438\u0438
        \u0438 \u044d\u0442\u043d\u043e\u0433\u0440\u0430\u0444\u0438\u0438 \u043d\u0430\u0440\u043e\u0434\u043e\u0432
        \u0414\u0430\u043b\u044c\u043d\u0435\u0433\u043e \u0412\u043e\u0441\u0442\u043e\u043a\u0430
        \u0414\u0412\u041e \u0420\u0410\u041d":1,"\u0418\u043d\u0441\u0442\u0438\u0442\u0443\u0442
        \u0437\u0435\u043c\u043d\u043e\u0439 \u043a\u043e\u0440\u044b \u0421\u041e
        \u0420\u0410\u041d":1,"\u0418\u043d\u0441\u0442\u0438\u0442\u0443\u0442 \u0434\u0438\u043d\u0430\u043c\u0438\u043a\u0438
        \u0441\u0438\u0441\u0442\u0435\u043c \u0438 \u0442\u0435\u043e\u0440\u0438\u0438
        \u0443\u043f\u0440\u0430\u0432\u043b\u0435\u043d\u0438\u044f \u0438\u043c\u0435\u043d\u0438
        \u0412.\u041c. \u041c\u0430\u0442\u0440\u043e\u0441\u043e\u0432\u0430 \u0421\u041e
        \u0420\u0410\u041d":1,"\u0418\u043d\u0441\u0442\u0438\u0442\u0443\u0442 \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0430
        \u0438 \u043f\u0440\u0430\u0432\u0430 \u0420\u0410\u041d":1,"\u0418\u043d\u0441\u0442\u0438\u0442\u0443\u0442
        \u0433\u0435\u043e\u0433\u0440\u0430\u0444\u0438\u0438 \u0438\u043c. \u0412.\u0411.
        \u0421\u043e\u0447\u0430\u0432\u044b \u0421\u041e \u0420\u0410\u041d":1,"\u0418\u043d\u0441\u0442\u0438\u0442\u0443\u0442
        \u0431\u0438\u043e\u0445\u0438\u043c\u0438\u0447\u0435\u0441\u043a\u043e\u0439
        \u0444\u0438\u0437\u0438\u043a\u0438 \u0438\u043c. \u041d.\u041c. \u042d\u043c\u0430\u043d\u0443\u044d\u043b\u044f
        \u0420\u0410\u041d":1,"\u0418\u043d\u0441\u0442\u0438\u0442\u0443\u0442 \u0431\u0438\u043e\u0445\u0438\u043c\u0438\u0438
        \u0438 \u0444\u0438\u0437\u0438\u043e\u043b\u043e\u0433\u0438\u0438 \u043c\u0438\u043a\u0440\u043e\u043e\u0440\u0433\u0430\u043d\u0438\u0437\u043c\u043e\u0432
        \u0438\u043c. \u0413.\u041a. \u0421\u043a\u0440\u044f\u0431\u0438\u043d\u0430
        \u0420\u0410\u041d":1,"\u0418\u043d\u0441\u0442\u0438\u0442\u0443\u0442 \u0431\u0438\u043e\u043e\u0440\u0433\u0430\u043d\u0438\u0447\u0435\u0441\u043a\u043e\u0439
        \u0445\u0438\u043c\u0438\u0438 \u0438\u043c. \u0430\u043a\u0430\u0434. \u041c.\u041c.
        \u0428\u0435\u043c\u044f\u043a\u0438\u043d\u0430 \u0438 \u042e.\u0410. \u041e\u0432\u0447\u0438\u043d\u043d\u0438\u043a\u043e\u0432\u0430
        \u0420\u0410\u041d":1,"\u0418\u043d\u0441\u0442\u0438\u0442\u0443\u0442 \u041c\u0438\u043a\u0440\u043e\u0431\u0438\u043e\u043b\u043e\u0433\u0438\u0438
        \u041d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u043e\u0439 \u0410\u043a\u0430\u0434\u0435\u043c\u0438\u0438
        \u043d\u0430\u0443\u043a":1,"\u0418\u043d\u0433\u0443\u0448\u0441\u043a\u0438\u0439
        \u043d\u0430\u0443\u0447\u043d\u043e-\u0438\u0441\u0441\u043b\u0435\u0434\u043e\u0432\u0430\u0442\u0435\u043b\u044c\u0441\u043a\u0438\u0439
        \u0438\u043d\u0441\u0442\u0438\u0442\u0443\u0442 \u0433\u0443\u043c\u0430\u043d\u0438\u0442\u0430\u0440\u043d\u044b\u0445
        \u043d\u0430\u0443\u043a \u0438\u043c. \u0427.\u042d. \u0410\u0445\u0440\u0438\u0435\u0432\u0430":1,"\u0418\u0432\u0430\u043d\u043e\u0432\u0441\u043a\u0438\u0439
        \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439
        \u0445\u0438\u043c\u0438\u043a\u043e-\u0442\u0435\u0445\u043d\u043e\u043b\u043e\u0433\u0438\u0447\u0435\u0441\u043a\u0438\u0439
        \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442":1,"\u0418\u0432\u0430\u043d\u043e\u0432\u0441\u043a\u0438\u0439
        \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439
        \u043f\u043e\u043b\u0438\u0442\u0435\u0445\u043d\u0438\u0447\u0435\u0441\u043a\u0438\u0439
        \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442\u0430":1,"\u0418\u0432\u0430\u043d\u043e\u0432\u0441\u043a\u0438\u0439
        \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439
        \u043f\u043e\u043b\u0438\u0442\u0435\u0445\u043d\u0438\u0447\u0435\u0441\u043a\u0438\u0439
        \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442":1,"\u0418\u0421\u041f\u041d
        \u0424\u0413\u0410\u041e\u0423 \u0412\u041e \u0423\u0440\u0424\u0423 \u0438\u043c\u0435\u043d\u0438
        \u043f\u0435\u0440\u0432\u043e\u0433\u043e \u041f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442\u0430
        \u0420\u043e\u0441\u0441\u0438\u0438 \u0411. \u041d. \u0415\u043b\u044c\u0446\u0438\u043d\u0430":1,"\u0418\u041f\u0423
        \u0420\u0410\u041d":1,"\u0417\u0430\u0431\u0430\u0439\u043a\u0430\u043b\u044c\u0441\u043a\u0438\u0439
        \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439
        \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442":1,"\u0417\u0410\u041e
        \"\u0420\u0435\u0448\u0435\u043d\u0438\u0435\"":1,"\u0415\u0434\u0438\u043d\u0430\u044f
        \u0430\u0442\u0442\u0435\u0441\u0442\u0430\u0446\u0438\u043e\u043d\u043d\u0430\u044f
        \u043a\u043e\u043c\u0438\u0441\u0441\u0438\u044f":1,"\u0415\u0432\u0440\u043e\u043f\u0435\u0439\u0441\u043a\u0438\u0439
        \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442 \u0432
        \u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\u0435":1,"\u0414\u043e\u043d\u0441\u043a\u043e\u0439
        \u0413\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439
        \u0422\u0435\u0445\u043d\u0438\u0447\u0435\u0441\u043a\u0438\u0439 \u0423\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442":1,"\u0414\u0430\u043b\u044c\u043d\u0435\u0432\u043e\u0441\u0442\u043e\u0447\u043d\u044b\u0439
        \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439
        \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442 \u043f\u0443\u0442\u0435\u0439
        \u0441\u043e\u043e\u0431\u0449\u0435\u043d\u0438\u044f":1,"\u0414\u0430\u0433\u0435\u0441\u0442\u0430\u043d\u0441\u043a\u0438\u0439
        \u0438\u043d\u0441\u0442\u0438\u0442\u0443\u0442 \u0440\u0430\u0437\u0432\u0438\u0442\u0438\u044f
        \u043e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u043d\u0438\u044f":1,"\u0414\u0430\u0433\u0435\u0441\u0442\u0430\u043d\u0441\u043a\u0438\u0439
        \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439
        \u0438\u043d\u0441\u0442\u0438\u0442\u0443\u0442 \u043d\u0430\u0440\u043e\u0434\u043d\u043e\u0433\u043e
        \u0445\u043e\u0437\u044f\u0439\u0441\u0442\u0432\u0430":1,"\u0414\u0413\u0422\u0423":1,"\u0413\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439
        \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442 \u043c\u043e\u0440\u0441\u043a\u043e\u0433\u043e
        \u0438 \u0440\u0435\u0447\u043d\u043e\u0433\u043e \u0444\u043b\u043e\u0442\u0430
        \u0438\u043c. \u0430\u0434\u043c\u0438\u0440\u0430\u043b\u0430 \u0421.\u041e.
        \u041c\u0430\u043a\u0430\u0440\u043e\u0432\u0430":1,"\u0413\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439
        \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442 \"\u0414\u0443\u0431\u043d\u0430\"":1,"\u0413\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439
        \u0441\u043e\u0446\u0438\u0430\u043b\u044c\u043d\u043e-\u0433\u0443\u043c\u0430\u043d\u0438\u0442\u0430\u0440\u043d\u044b\u0439
        \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442":1,"\u0413\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439
        \u0438\u043d\u0441\u0442\u0438\u0442\u0443\u0442 \u044d\u043a\u043e\u043d\u043e\u043c\u0438\u043a\u0438,
        \u0444\u0438\u043d\u0430\u043d\u0441\u043e\u0432, \u043f\u0440\u0430\u0432\u0430
        \u0438 \u0442\u0435\u0445\u043d\u043e\u043b\u043e\u0433\u0438\u0439":1,"\u0413\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439
        \u0438\u043d\u0441\u0442\u0438\u0442\u0443\u0442 \u0440\u0443\u0441\u0441\u043a\u043e\u0433\u043e
        \u044f\u0437\u044b\u043a\u0430 \u0438\u043c. \u0410.\u0421. \u041f\u0443\u0448\u043a\u0438\u043d\u0430":1,"\u0413\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439
        \u0438\u043d\u0441\u0442\u0438\u0442\u0443\u0442 \u043b\u0435\u043a\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0445
        \u0441\u0440\u0435\u0434\u0441\u0442\u0432 \u0438 \u043d\u0430\u0434\u043b\u0435\u0436\u0430\u0449\u0438\u0445
        \u043f\u0440\u0430\u043a\u0442\u0438\u043a":1,"\u0413\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0435
        \u0431\u044e\u0434\u0436\u0435\u0442\u043d\u043e\u0435 \u0443\u0447\u0440\u0435\u0436\u0434\u0435\u043d\u0438\u0435
        \u0437\u0434\u0440\u0430\u0432\u043e\u043e\u0445\u0440\u0430\u043d\u0435\u043d\u0438\u044f
        \u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0438 \u041a\u0440\u044b\u043c
        \u00ab\u0410\u043a\u0430\u0434\u0435\u043c\u0438\u0447\u0435\u0441\u043a\u0438\u0439
        \u041d\u0418\u0418 \u0444\u0438\u0437\u0438\u0447\u0435\u0441\u043a\u0438\u0445
        \u043c\u0435\u0442\u043e\u0434\u043e\u0432 \u043b\u0435\u0447\u0435\u043d\u0438\u044f,
        \u043c\u0435\u0434\u0438\u0446\u0438\u043d\u0441\u043a\u043e\u0439 \u043a\u043b\u0438\u043c\u0430\u0442\u043e\u043b\u043e\u0433\u0438\u0438
        \u0438 \u0440\u0435\u0430\u0431\u0438\u043b\u0438\u0442\u0430\u0446\u0438\u0438
        \u0438\u043c. \u0418.\u041c.\u0421\u0435\u0447\u0435\u043d\u043e\u0432\u0430\u00bb":1,"\u0413\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0435
        \u0431\u044e\u0434\u0436\u0435\u0442\u043d\u043e\u0435 \u043f\u0440\u043e\u0444\u0435\u0441\u0441\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u043e\u0435
        \u043e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u0442\u0435\u043b\u044c\u043d\u043e\u0435
        \u0443\u0447\u0440\u0435\u0436\u0434\u0435\u043d\u0438\u0435 \u0410\u0441\u0442\u0440\u0430\u0445\u0430\u043d\u0441\u043a\u043e\u0439
        \u043e\u0431\u043b\u0430\u0441\u0442\u0438 \u00ab\u0410\u0441\u0442\u0440\u0430\u0445\u0430\u043d\u0441\u043a\u0438\u0439
        \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439
        \u043f\u043e\u043b\u0438\u0442\u0435\u0445\u043d\u0438\u0447\u0435\u0441\u043a\u0438\u0439
        \u043a\u043e\u043b\u043b\u0435\u0434\u0436\u00bb":1,"\u0413\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u0430\u044f
        \u0414\u0443\u043c\u0430 \u0424\u0435\u0434\u0435\u0440\u0430\u043b\u044c\u043d\u043e\u0433\u043e
        \u0421\u043e\u0431\u0440\u0430\u043d\u0438\u044f \u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0439
        \u0424\u0435\u0434\u0435\u0440\u0430\u0446\u0438\u0438":1,"\u0413\u043e\u043c\u0435\u043b\u044c\u0441\u043a\u0438\u0439
        \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439
        \u043c\u0435\u0434\u0438\u0446\u0438\u043d\u0441\u043a\u0438\u0439 \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442":1,"\u0413\u043e\u043b\u0438\u0446\u044b\u043d\u0441\u043a\u0438\u0439
        \u043f\u043e\u0433\u0440\u0430\u043d\u0438\u0447\u043d\u044b\u0439 \u0438\u043d\u0441\u0442\u0438\u0442\u0443\u0442
        \u0424\u0421\u0411 \u0420\u043e\u0441\u0441\u0438\u0438":1,"\u0413\u0438\u043c\u043d\u0430\u0437\u0438\u044f
        \u2116 23 \u0433. \u0427\u0435\u043b\u044f\u0431\u0438\u043d\u0441\u043a\u0430
        \u0438\u043c. \u0412.\u0414.\u041b\u0443\u0446\u0435\u043d\u043a\u043e":1,"\u0413\u0434\u0430\u043d\u044c\u0441\u043a\u0438\u0439
        \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442":1,"\u0413\u0423\u041f
        \"\u041d\u0418\u0438\u041f\u0418 \u0413\u0435\u043d\u043f\u043b\u0430\u043d\u0430
        \u041c\u043e\u0441\u043a\u0432\u044b\"":1,"\u0413\u0423 \u00ab\u0411\u0435\u043b\u043e\u0440\u0443\u0441\u0441\u043a\u0430\u044f
        \u0441\u0435\u043b\u044c\u0441\u043a\u043e\u0445\u043e\u0437\u044f\u0439\u0441\u0442\u0432\u0435\u043d\u043d\u0430\u044f
        \u0431\u0438\u0431\u043b\u0438\u043e\u0442\u0435\u043a\u0430\r\n\u0438\u043c.
        \u0418.\u0421. \u041b\u0443\u043f\u0438\u043d\u043e\u0432\u0438\u0447\u0430\u00bb
        \u041d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u043e\u0439 \u0430\u043a\u0430\u0434\u0435\u043c\u0438\u0438
        \u043d\u0430\u0443\u043a \u0411\u0435\u043b\u0430\u0440\u0443\u0441\u0438":1,"\u0413\u041e\u0423
        \u0414\u041f\u041e \u0427\u0435\u043b\u044f\u0431\u0438\u043d\u0441\u043a\u0438\u0439
        \u0438\u043d\u0441\u0442\u0438\u0442\u0443\u0442 \u043f\u0435\u0440\u0435\u043f\u043e\u0434\u0433\u043e\u0442\u043e\u0432\u043a\u0438
        \u0438 \u043f\u043e\u0432\u044b\u0448\u0435\u043d\u0438\u044f \u043a\u0432\u0430\u043b\u0438\u0444\u0438\u043a\u0430\u0446\u0438\u0438
        \u0440\u0430\u0431\u043e\u0442\u043d\u0438\u043a\u043e\u0432 \u043e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u043d\u0438\u044f":1,"\u0413\u0418\u042d\u0424\u041f\u0422":1,"\u0413\u0411\u0423\u0417
        \u041c\u043e\u0441\u043a\u043e\u0432\u0441\u043a\u043e\u0439 \u043e\u0431\u043b\u0430\u0441\u0442\u0438
        \u00ab\u0426\u0435\u043d\u0442\u0440\u0430\u043b\u044c\u043d\u0430\u044f \u043a\u043b\u0438\u043d\u0438\u0447\u0435\u0441\u043a\u0430\u044f
        \u043f\u0441\u0438\u0445\u0438\u0430\u0442\u0440\u0438\u0447\u0435\u0441\u043a\u0430\u044f
        \u0431\u043e\u043b\u044c\u043d\u0438\u0446\u0430\u00bb":1,"\u0413\u0411\u041f\u041e\u0423
        \u041a\u043e\u043b\u043b\u0435\u0434\u0436 \u0441\u043e\u0432\u0440\u0435\u043c\u0435\u043d\u043d\u044b\u0445
        \u0442\u0435\u0445\u043d\u043e\u043b\u043e\u0433\u0438\u0439, \u0433. \u041c\u043e\u0441\u043a\u0432\u0430":1,"\u0413\u0411\u041e\u0423
        \u0428\u043a\u043e\u043b\u0430 \u2116 2109 \u041c\u043e\u0441\u043a\u0432\u0430":1,"\u0413\u0411\u041e\u0423
        \u00ab\u0428\u043a\u043e\u043b\u0430 \u21161517\u00bb":1,"\u0413\u0410\u041e\u0423
        \u0412\u041e \u00ab\u041c\u043e\u0441\u043a\u043e\u0432\u0441\u043a\u0438\u0439
        \u0433\u043e\u0440\u043e\u0434\u0441\u043a\u043e\u0439 \u043f\u0435\u0434\u0430\u0433\u043e\u0433\u0438\u0447\u0435\u0441\u043a\u0438\u0439
        \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442\u00bb (\u0433.
        \u041c\u043e\u0441\u043a\u0432\u0430)":1,"\u0412\u0456\u043d\u043d\u0438\u0446\u044c\u043a\u0438\u0439
        \u043d\u0430\u0446\u0456\u043e\u043d\u0430\u043b\u044c\u043d\u0438\u0439 \u0442\u0435\u0445\u043d\u0456\u0447\u043d\u0438\u0439
        \u0443\u043d\u0456\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442":1,"\u0412\u044b\u0441\u0448\u0430\u044f
        \u0448\u043a\u043e\u043b\u0430 \u0431\u0438\u0437\u043d\u0435\u0441-\u0442\u0435\u0445\u043d\u043e\u043b\u043e\u0433\u0438\u0439":1,"\u0412\u0441\u0435\u0440\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0438\u0439
        \u043d\u0430\u0443\u0447\u043d\u043e-\u0438\u0441\u0441\u043b\u0435\u0434\u043e\u0432\u0430\u0442\u0435\u043b\u044c\u0441\u043a\u0438\u0439
        \u0438\u043d\u0441\u0442\u0438\u0442\u0443\u0442 \u0440\u044b\u0431\u043d\u043e\u0433\u043e
        \u0445\u043e\u0437\u044f\u0439\u0441\u0442\u0432\u0430 \u0438 \u043e\u043a\u0435\u0430\u043d\u043e\u0433\u0440\u0430\u0444\u0438\u0438":1,"\u0412\u0441\u0435\u0440\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0438\u0439
        \u043d\u0430\u0443\u0447\u043d\u043e-\u0438\u0441\u0441\u043b\u0435\u0434\u043e\u0432\u0430\u0442\u0435\u043b\u044c\u0441\u043a\u0438\u0439
        \u0438 \u0442\u0435\u0445\u043d\u043e\u043b\u043e\u0433\u0438\u0447\u0435\u0441\u043a\u0438\u0439
        \u0438\u043d\u0441\u0442\u0438\u0442\u0443\u0442 \u043f\u0442\u0438\u0446\u0435\u0432\u043e\u0434\u0441\u0442\u0432\u0430
        \u0420\u0410\u041d":1,"\u0412\u0441\u0435\u0440\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0438\u0439
        \u043d\u0430\u0443\u0447\u043d\u043e-\u0438\u0441\u0441\u043b\u0435\u0434\u043e\u0432\u0430\u0442\u0435\u043b\u044c\u0441\u043a\u0438\u0439
        \u0438 \u0442\u0435\u0445\u043d\u043e\u043b\u043e\u0433\u0438\u0447\u0435\u0441\u043a\u0438\u0439
        \u0438\u043d\u0441\u0442\u0438\u0442\u0443\u0442 \u043f\u0442\u0438\u0446\u0435\u0432\u043e\u0434\u0441\u0442\u0432\u0430":1,"\u0412\u0441\u0435\u0440\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0430\u044f
        \u0430\u043a\u0430\u0434\u0435\u043c\u0438\u044f \u0432\u043d\u0435\u0448\u043d\u0435\u0439
        \u0442\u043e\u0440\u0433\u043e\u0432\u043b\u0438 \u041c\u0438\u043d\u0438\u0441\u0442\u0435\u0440\u0441\u0442\u0432\u0430
        \u044d\u043a\u043e\u043d\u043e\u043c\u0438\u0447\u0435\u0441\u043a\u043e\u0433\u043e
        \u0440\u0430\u0437\u0432\u0438\u0442\u0438\u044f \u0420\u0424":1,"\u0412\u0441\u0435\u0440\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0430\u044f
        \u0430\u043a\u0430\u0434\u0435\u043c\u0438\u044f \u0432\u043d\u0435\u0448\u043d\u0435\u0439
        \u0442\u043e\u0440\u0433\u043e\u0432\u043b\u0438":1,"\u0412\u043e\u0440\u043e\u043d\u0435\u0436\u0441\u043a\u0438\u0439
        \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439
        \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442":1,"\u0412\u043e\u0440\u043e\u043d\u0435\u0436\u0441\u043a\u0430\u044f
        \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u0430\u044f
        \u043c\u0435\u0434\u0438\u0446\u0438\u043d\u0441\u043a\u0430\u044f \u0430\u043a\u0430\u0434\u0435\u043c\u0438\u044f
        \u0438\u043c. \u041d.\u041d. \u0411\u0443\u0440\u0434\u0435\u043d\u043a\u043e":1,"\u0412\u043e\u043b\u0433\u043e\u0433\u0440\u0430\u0434\u0441\u043a\u0438\u0439
        \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439
        \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442":1,"\u0412\u043e\u043b\u0433\u043e\u0433\u0440\u0430\u0434\u0441\u043a\u0438\u0439
        \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439
        \u0442\u0435\u0445\u043d\u0438\u0447\u0435\u0441\u043a\u0438\u0439 \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442":1,"\u0412\u043e\u043b\u0433\u043e\u0433\u0440\u0430\u0434\u0441\u043a\u0438\u0439
        \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439
        \u0442\u0435\u0445\u043d\u0438\u0447\u0435\u0441\u043a\u0438\u0439 \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435":1,"\u0412\u043e\u043b\u0433\u043e\u0433\u0440\u0430\u0434\u0441\u043a\u0438\u0439
        \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439
        \u0441\u043e\u0446\u0438\u0430\u043b\u044c\u043d\u043e-\u043f\u0435\u0434\u0430\u0433\u043e\u0433\u0438\u0447\u0435\u0441\u043a\u0438\u0439
        \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442":1,"\u0412\u043e\u0435\u043d\u043d\u044b\u0439
        \u0443\u0447\u0435\u0431\u043d\u043e-\u043d\u0430\u0443\u0447\u043d\u044b\u0439
        \u0446\u0435\u043d\u0442\u0440 \u0412\u043e\u0435\u043d\u043d\u043e-\u0432\u043e\u0437\u0434\u0443\u0448\u043d\u044b\u0445
        \u0441\u0438\u043b \u00ab\u0412\u043e\u0435\u043d\u043d\u043e-\u0432\u043e\u0437\u0434\u0443\u0448\u043d\u0430\u044f
        \u0430\u043a\u0430\u0434\u0435\u043c\u0438\u044f \u0438\u043c. \u043f\u0440\u043e\u0444.
        \u041d.\u0415. \u0416\u0443\u043a\u043e\u0432\u0441\u043a\u043e\u0433\u043e
        \u0438 \u042e.\u0410. \u0413\u0430\u0433\u0430\u0440\u0438\u043d\u0430\u00bb":1,"\u0412\u043e\u0435\u043d\u043d\u044b\u0439
        \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442\u00bb \u041c\u0438\u043d\u0438\u0441\u0442\u0435\u0440\u0441\u0442\u0432\u0430
        \u043e\u0431\u043e\u0440\u043e\u043d\u044b \u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0439
        \u0424\u0435\u0434\u0435\u0440\u0430\u0446\u0438\u0438":1,"\u0412\u043e\u0435\u043d\u043d\u044b\u0439
        \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442 \u041c\u0438\u043d\u0438\u0441\u0442\u0435\u0440\u0441\u0442\u0432\u0430
        \u043e\u0431\u043e\u0440\u043e\u043d\u044b \u0420\u0424":1,"\u0412\u043e\u0435\u043d\u043d\u043e\u0433\u043e
        \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442\u0430 \u041c\u0438\u043d\u0438\u0441\u0442\u0435\u0440\u0441\u0442\u0432\u0430
        \u043e\u0431\u043e\u0440\u043e\u043d\u044b \u0420\u0424":1,"\u0412\u043e\u0435\u043d\u043d\u043e-\u043c\u0435\u0434\u0438\u0446\u0438\u043d\u0441\u043a\u0430\u044f
        \u0430\u043a\u0430\u0434\u0435\u043c\u0438\u044f \u0438\u043c\u0435\u043d\u0438
        \u0421.\u041c. \u041a\u0438\u0440\u043e\u0432\u0430":1,"\u0412\u043e\u0435\u043d\u043d\u0430\u044f
        \u0430\u043a\u0430\u0434\u0435\u043c\u0438\u044f \u043c\u0430\u0442\u0435\u0440\u0438\u0430\u043b\u044c\u043d\u043e-\u0442\u0435\u0445\u043d\u0438\u0447\u0435\u0441\u043a\u043e\u0433\u043e
        \u043e\u0431\u0435\u0441\u043f\u0435\u0447\u0435\u043d\u0438\u044f \u0438\u043c.
        \u0433\u0435\u043d\u0435\u0440\u0430\u043b\u0430 \u0430\u0440\u043c\u0438\u0438
        \u0410. \u0412. \u0425\u0440\u0443\u043b\u0435\u0432\u0430":1,"\u0412\u043e\u0435\u043d\u043d\u0430\u044f
        \u0430\u043a\u0430\u0434\u0435\u043c\u0438\u044f \u043c\u0430\u0442\u0435\u0440\u0438\u0430\u043b\u044c\u043d\u043e-\u0442\u0435\u0445\u043d\u0438\u0447\u0435\u0441\u043a\u043e\u0433\u043e
        \u043e\u0431\u0435\u0441\u043f\u0435\u0447\u0435\u043d\u0438\u044f (\u0444\u0438\u043b\u0438\u0430\u043b,
        \u0433. \u041f\u0435\u043d\u0437\u0430)":1,"\u0412\u043b\u0430\u0434\u0438\u043c\u0438\u0440\u0441\u043a\u0438\u0439
        \u0444\u0438\u043b\u0438\u0430\u043b \u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0439
        \u0430\u043a\u0430\u0434\u0435\u043c\u0438\u0438 \u043d\u0430\u0440\u043e\u0434\u043d\u043e\u0433\u043e
        \u0445\u043e\u0437\u044f\u0439\u0441\u0442\u0432\u0430 \u0438 \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0439
        \u0441\u043b\u0443\u0436\u0431\u044b \u043f\u0440\u0438 \u041f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442\u0435
        \u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0439 \u0424\u0435\u0434\u0435\u0440\u0430\u0446\u0438\u0438":1,"\u0412\u043b\u0430\u0434\u0438\u043c\u0438\u0440\u0441\u043a\u0438\u0439
        \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439
        \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442 \u0438\u043c\u0435\u043d\u0438
        \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0430 \u0413\u0440\u0438\u0433\u043e\u0440\u044c\u0435\u0432\u0438\u0447\u0430
        \u0438 \u041d\u0438\u043a\u043e\u043b\u0430\u044f \u0413\u0440\u0438\u0433\u043e\u0440\u044c\u0435\u0432\u0438\u0447\u0430
        \u0421\u0442\u043e\u043b\u0435\u0442\u043e\u0432\u044b\u0445":1,"\u0412\u0435\u0440\u0445\u043d\u0435-\u0412\u043e\u043b\u0436\u0441\u043a\u0438\u0439
        \u0440\u0435\u0433\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u044b\u0439 \u0446\u0435\u043d\u0442\u0440
        \u0430\u043a\u0430\u0434\u0435\u043c\u0438\u0447\u0435\u0441\u043a\u043e\u0439
        \u043c\u043e\u0431\u0438\u043b\u044c\u043d\u043e\u0441\u0442\u0438":1,"\u0412\u0435\u043d\u0441\u043a\u0438\u0439
        \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442":1,"\u0412\u0435\u043d\u0441\u043a\u0438\u0439
        \u0422\u0435\u0445\u043d\u0438\u0447\u0435\u0441\u043a\u0438\u0439 \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442":1,"\u0412\u0413\u041c\u0423
        \u0438\u043c. \u041d. \u041d. \u0411\u0443\u0440\u0434\u0435\u043d\u043a\u043e":1,"\u0412\u0410\u0412\u0422
        \u041c\u0438\u043d\u044d\u043a\u043e\u043d\u043e\u043c\u0440\u0430\u0437\u0432\u0438\u0442\u0438\u044f
        \u0420\u043e\u0441\u0441\u0438\u0438":1,"\u0411\u0435\u043b\u043e\u0440\u0443\u0441\u0441\u043a\u0438\u0439
        \u043d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u044b\u0439 \u0442\u0435\u0445\u043d\u0438\u0447\u0435\u0441\u043a\u0438\u0439
        \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442":1,"\u0411\u0435\u043b\u043e\u0440\u0443\u0441\u0441\u043a\u0438\u0439
