        \u0431\u044e\u0434\u0436\u0435\u0442\u043d\u043e\u0435 \u043d\u0430\u0443\u0447\u043d\u043e\u0435
        \u0443\u0447\u0440\u0435\u0436\u0434\u0435\u043d\u0438\u0435 \"\u0412\u0435\u0440\u0445\u043d\u0435\u0432\u043e\u043b\u0436\u0441\u043a\u0438\u0439
        \u0444\u0435\u0434\u0435\u0440\u0430\u043b\u044c\u043d\u044b\u0439 \u0430\u0433\u0440\u0430\u0440\u043d\u044b\u0439
        \u043d\u0430\u0443\u0447\u043d\u044b\u0439 \u0446\u0435\u043d\u0442\u0440\"":2,"\u0424\u0413\u0423\u041f
        \u00ab\u0420\u0424\u042f\u0426-\u0412\u041d\u0418\u0418\u042d\u0424\u00bb":2,"\u0423\u0444\u0430
        \u00ab\u0413\u0438\u043b\u0435\u043c\u00bb":2,"\u0423\u043a\u0440\u0430\u0457\u043d\u0441\u044c\u043a\u0438\u0439
        \u0434\u0435\u0440\u0436\u0430\u0432\u043d\u0438\u0439 \u0443\u043d\u0456\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442
        \u043d\u0430\u0443\u043a\u0438 \u0456 \u0442\u0435\u0445\u043d\u043e\u043b\u043e\u0433\u0456\u0439":2,"\u0422\u043e\u0432
        \u0412\u041d\u041f \"\u0406\u043d\u0442\u0435\u0440\u0441\u0435\u0440\u0432\u0456\u0441\"":2,"\u0422\u0432\u0456\u043c
        \u0456\u043d\u0442\u0435\u0440":2,"\u0421\u0443\u043c\u0441\u044c\u043a\u0438\u0439
        \u0434\u0435\u0440\u0436\u0430\u0432\u043d\u0438\u0439 \u043f\u0435\u0434\u0430\u0433\u043e\u0433\u0456\u0447\u043d\u0438\u0439
        \u0443\u043d\u0456\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442 \u0456\u043c\u0435\u043d\u0456
        \u0410.\u0421. \u041c\u0430\u043a\u0430\u0440\u0435\u043d\u043a\u0430":2,"\u0421\u041f\u0431
        \u0424\u0418\u0426 \u0420\u0410\u041d":2,"\u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0438\u0439
        \u0413\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439
        \u0410\u0433\u0440\u0430\u0440\u043d\u044b\u0439 \u0417\u0430\u043e\u0447\u043d\u044b\u0439
        \u0423\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442":2,"\u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0430\u044f
        \u0430\u043a\u0430\u0434\u0435\u043c\u0438\u044f \u043d\u0430\u0440\u043e\u0434\u043d\u043e\u0433\u043e
        \u0445\u043e\u0437\u044f\u0439\u0441\u0442\u0432\u0430 \u0438 \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0439
        \u0441\u043b\u0443\u0436\u0431\u044b \u043f\u0440\u0438 \u041f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442\u0435
        \u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0439 \u0424\u0435\u0434\u0435\u0440\u0430\u0446\u0438\u0438.
        \u0421\u0435\u0432\u0435\u0440\u043e-\u0417\u0430\u043f\u0430\u0434\u043d\u044b\u0439
        \u0438\u043d\u0441\u0442\u0438\u0442\u0443\u0442 \u0443\u043f\u0440\u0430\u0432\u043b\u0435\u043d\u0438\u044f":2,"\u041f\u043e\u043b\u0438\u043a\u043e\u0440":2,"\u041f\u0435\u043d\u0437\u0435\u043d\u0441\u043a\u0438\u0439
        \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439
        \u0430\u0433\u0440\u0430\u0440\u043d\u044b\u0439 \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442":2,"\u041f\u041d\u041f\u0423
        \u0456\u043c\u0435\u043d\u0456 \u0412.\u00a0\u0413.\u00a0\u041a\u043e\u0440\u043e\u043b\u0435\u043d\u043a\u0430":2,"\u041e\u0441\u043d\u043e\u0432\u0430":2,"\u041e\u0441\u0432\u0456\u0442\u0430":2,"\u041e\u0440\u0435\u043b\u0413\u0423\u042d\u0422":2,"\u041e\u0431\u0449\u0435\u0441\u0442\u0432\u043e
        \u0441 \u043e\u0433\u0440\u0430\u043d\u0438\u0447\u0435\u043d\u043d\u043e\u0439
        \u043e\u0442\u0432\u0435\u0442\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0441\u0442\u044c\u044e
        \"\u0418\u0437\u0434\u0430\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e
        \u0410\u041b\u0415\u0424\"":2,"\u041e\u0431\u0449\u0435\u0441\u0442\u0432\u043e
        \u0441 \u043e\u0433\u0440\u0430\u043d\u0438\u0447\u0435\u043d\u043d\u043e\u0439
        \u043e\u0442\u0432\u0435\u0442\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0441\u0442\u044c\u044e
        \"\u0418\u0417\u0414\u0410\u0422\u0415\u041b\u042c\u0421\u041a\u0418\u0419
        \u0414\u041e\u041c \u0412\u041a\u041d\"":2,"\u041e\u041e\u041e \u00ab\u0421\u043e\u044e\u0437
        \u043c\u0430\u0440\u043a\u0448\u0435\u0439\u0434\u0435\u0440\u043e\u0432 \u0420\u043e\u0441\u0441\u0438\u0438\u00bb":2,"\u041e\u041e\u041e
        \"\u041d\u043e\u0440\u0434\u043c\u0435\u0434\u0438\u0437\u0434\u0430\u0442\"":2,"\u041e\u041e\u041e
        \"\u0418\u0437\u0434\u0430\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e
        \"\u0412\u0435\u0441\u044c \u041c\u0438\u0440\"":2,"\u041d\u043e\u0432\u043e\u0441\u0438\u0431\u0438\u0440\u0441\u043a,
        \u041d\u0430\u0443\u043a\u0430":2,"\u041d\u0435\u0441\u0442\u043e\u0440-\u0418\u0441\u0442\u043e\u0440\u0438\u044f":2,"\u041d\u0430\u0446\u0456\u043e\u043d\u0430\u043b\u044c\u043d\u0438\u0439
        \u0443\u043d\u0456\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442 \"\u041e\u0434\u0435\u0441\u044c\u043a\u0430
        \u044e\u0440\u0438\u0434\u0438\u0447\u043d\u0430 \u0430\u043a\u0430\u0434\u0435\u043c\u0456\u044f\"":2,"\u041d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u044b\u0439
        \u0438\u043d\u0441\u0442\u0438\u0442\u0443\u0442 \u043f\u0440\u043e\u0444\u0435\u0441\u0441\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u044b\u0445
        \u0431\u0443\u0445\u0433\u0430\u043b\u0442\u0435\u0440\u043e\u0432, \u0444\u0438\u043d\u0430\u043d\u0441\u043e\u0432\u044b\u0445
        \u043c\u0435\u043d\u0435\u0434\u0436\u0435\u0440\u043e\u0432 \u0438 \u044d\u043a\u043e\u043d\u043e\u043c\u0438\u0441\u0442\u043e\u0432":2,"\u041d\u041f\u041f
        \u0410\u0421\u0422\u0415\u0420\u0406\u041a\u0421":2,"\u041c\u0435\u0436\u0440\u0435\u0433\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u044b\u0439
        \u0446\u0435\u043d\u0442\u0440  \u0438\u043d\u043d\u043e\u0432\u0430\u0446\u0438\u043e\u043d\u043d\u044b\u0445
        \u0442\u0435\u0445\u043d\u043e\u043b\u043e\u0433\u0438\u0439 \u0432 \u043e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u043d\u0438\u0438":2,"\u041c\u0435\u0436\u0434\u0443\u043d\u0430\u0440\u043e\u0434\u043d\u0430\u044f
        \u0410\u043a\u0430\u0434\u0435\u043c\u0438\u044f \u0424\u0438\u043d\u0430\u043d\u0441\u043e\u0432\u044b\u0445
        \u0422\u0435\u0445\u043d\u043e\u043b\u043e\u0433\u0438\u0439. \u0420\u043e\u0441\u0441\u0438\u044f":2,"\u041b\u044c\u043e\u0442\u043d\u0430
        \u0430\u043a\u0430\u0434\u0435\u043c\u0456\u044f \u041d\u0430\u0446\u0456\u043e\u043d\u0430\u043b\u044c\u043d\u043e\u0433\u043e
        \u0430\u0432\u0456\u0430\u0446\u0456\u0439\u043d\u043e\u0433\u043e \u0443\u043d\u0456\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442\u0443":2,"\u041a\u0440\u0438\u0432\u043e\u0440\u0456\u0437\u044c\u043a\u0438\u0439
        \u043f\u0435\u0434\u0430\u0433\u043e\u0433\u0456\u0447\u043d\u0438\u0439 \u0456\u043d\u0441\u0442\u0438\u0442\u0443\u0442
        \u0414\u0412\u041d\u0417 \"\u041a\u0440\u0438\u0432\u043e\u0440\u0456\u0437\u044c\u043a\u0438\u0439
        \u043d\u0430\u0446\u0456\u043e\u043d\u0430\u043b\u044c\u043d\u0438\u0439 \u0443\u043d\u0456\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442\"":2,"\u041a\u0440\u0438\u0432\u0438\u0439
        \u0420\u0456\u0433 : \u041a\u043d\u0438\u0436\u043a\u043e\u0432\u0435 \u0432\u0438\u0434\u0430\u0432\u043d\u0438\u0446\u0442\u0432\u043e
        \u041a\u0438\u0440\u0435\u0454\u0432\u0441\u044c\u043a\u043e\u0433\u043e":2,"\u041a\u0440\u0438\u0432\u0438\u0439
        \u0420\u0456\u0433 : \u0412\u0438\u0434\u0430\u0432\u043d\u0438\u0447\u0438\u0439
        \u0434\u0456\u043c":2,"\u041a\u043e\u043c\u0441\u043e\u043c\u043e\u043b\u044c\u0441\u043a\u0438\u0439-\u043d\u0430-\u0410\u043c\u0443\u0440\u0435
        \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439
        \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442":2,"\u041a\u041f\u0406":2,"\u041a\u0413\u041f\u0423":2,"\u0418\u043d\u0441\u0442\u0438\u0442\u0443\u0442
        \u044d\u043a\u043e\u043d\u043e\u043c\u0438\u043a\u0438 - \u043e\u0431\u043e\u0441\u043e\u0431\u043b\u0435\u043d\u043d\u043e\u0435
        \u043f\u043e\u0434\u0440\u0430\u0437\u0434\u0435\u043b\u0435\u043d\u0438\u0435
        \u0424\u0435\u0434\u0435\u0440\u0430\u043b\u044c\u043d\u043e\u0433\u043e \u0438\u0441\u0441\u043b\u0435\u0434\u043e\u0432\u0430\u0442\u0435\u043b\u044c\u0441\u043a\u043e\u0433\u043e
        \u0446\u0435\u043d\u0442\u0440\u0430 \"\u041a\u0430\u0440\u0435\u043b\u044c\u0441\u043a\u0438\u0439
        \u043d\u0430\u0443\u0447\u043d\u044b\u0439 \u0446\u0435\u043d\u0442\u0440
        \u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0439 \u0430\u043a\u0430\u0434\u0435\u043c\u0438\u0438
        \u043d\u0430\u0443\u043a\"":2,"\u0418\u043d\u0441\u0442\u0438\u0442\u0443\u0442
        \u0431\u0438\u043e\u043b\u043e\u0433\u0438\u0438 \u041a\u043e\u043c\u0438
        \u043d\u0430\u0443\u0447\u043d\u043e\u0433\u043e \u0446\u0435\u043d\u0442\u0440\u0430
        \u0423\u0440\u0430\u043b\u044c\u0441\u043a\u043e\u0433\u043e \u043e\u0442\u0434\u0435\u043b\u0435\u043d\u0438\u044f
        \u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0439 \u0430\u043a\u0430\u0434\u0435\u043c\u0438\u0438
        \u043d\u0430\u0443\u043a":2,"\u0418\u0437\u0434\u0430\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e
        \u041c\u0418\u0421\u0418\u2013\u041c\u0413\u0421\u0423":2,"\u0418\u0437\u0434\u0430\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e
        \u041a\u043e\u043b\u044c\u0441\u043a\u043e\u0433\u043e \u043d\u0430\u0443\u0447\u043d\u043e\u0433\u043e
        \u0446\u0435\u043d\u0442\u0440\u0430 \u0420\u0410\u041d":2,"\u0418\u0437\u0434\u0430\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e
        \u0418\u043a\u0430\u0440":2,"\u0418\u0437\u0434\u0430\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e
        \u0414\u0430\u043b\u044c\u043d\u0435\u0432\u043e\u0441\u0442\u043e\u0447\u043d\u043e\u0433\u043e
        \u0444\u0435\u0434\u0435\u0440\u0430\u043b\u044c\u043d\u043e\u0433\u043e \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442\u0430":2,"\u0418\u0437\u0434\u0430\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e
        \u00ab\u042e\u0440\u043b\u0438\u0442\u0438\u043d\u0444\u043e\u0440\u043c\u00bb":2,"\u0418\u0437\u0434\u0430\u0442\u0435\u043b\u044c\u0441\u043a\u043e-\u0442\u043e\u0440\u0433\u043e\u0432\u0430\u044f
        \u043a\u043e\u0440\u043f\u043e\u0440\u0430\u0446\u0438\u044f \u00ab\u0414\u0430\u0448\u043a\u043e\u0432
        \u0438 \u041a\u00b0\u00bb":2,"\u0418\u0437\u0434\u0430\u0442\u0435\u043b\u044c\u0441\u043a\u043e-\u043f\u043e\u043b\u0438\u0433\u0440\u0430\u0444\u0438\u0447\u0435\u0441\u043a\u0430\u044f
        \u0430\u0441\u0441\u043e\u0446\u0438\u0430\u0446\u0438\u044f \u0432\u044b\u0441\u0448\u0438\u0445
        \u0443\u0447\u0435\u0431\u043d\u044b\u0445 \u0437\u0430\u0432\u0435\u0434\u0435\u043d\u0438\u0439":2,"\u0418\u0437\u0434\u0430\u0442\u0435\u043b\u044c\u0441\u043a\u0438\u0439
        \u0434\u043e\u043c \u042f\u0421\u041a":2,"\u0418\u0437\u0434\u0430\u0442\u0435\u043b\u044c\u0441\u043a\u0438\u0439
        \u0434\u043e\u043c \u0414\u0430\u043b\u044c\u043d\u0435\u0432\u043e\u0441\u0442\u043e\u0447\u043d\u043e\u0433\u043e
        \u0444\u0435\u0434\u0435\u0440\u0430\u043b\u044c\u043d\u043e\u0433\u043e \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442\u0430":2,"\u0418\u0437\u0434\u0430\u0442\u0435\u043b\u044c\u0441\u043a\u0438\u0439
        \u0434\u043e\u043c \u00ab\u0410\u043a\u0430\u0434\u0435\u043c\u0438\u044f
        \u0415\u0441\u0442\u0435\u0441\u0442\u0432\u043e\u0437\u043d\u0430\u043d\u0438\u044f\u00bb":2,"\u0418\u0437\u0434-\u0432\u043e
        \u041c\u0430\u0433\u043d\u0438\u0442\u043e\u0433\u043e\u0440\u0441\u043a.
        \u0433\u043e\u0441. \u0442\u0435\u0445\u043d. \u0443\u043d-\u0442\u0430 \u0438\u043c.
        \u0413.\u0418. \u041d\u043e\u0441\u043e\u0432\u0430":2,"\u0418\u0426 \u041c\u041d\u0418\u0424
        \"\u041e\u0431\u0449\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u0430\u044f
        \u043d\u0430\u0443\u043a\u0430\"":2,"\u0418\u0424\u0417 \u0420\u0410\u041d":2,"\u0418\u0411
        \u041a\u043e\u043c\u0438 \u041d\u0426 \u0423\u0440\u041e \u0420\u0410\u041d":2,"\u0415\u043a\u0430\u0442\u0435\u0440\u0438\u043d\u0431\u0443\u0440\u0433:
        \u0418\u043d\u0441\u0442\u0438\u0442\u0443\u0442 \u044d\u043a\u043e\u043d\u043e\u043c\u0438\u043a\u0438
