        \u00ab\u0423\u043d\u0456\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442 \u0431\u0430\u043d\u043a\u0456\u0432\u0441\u044c\u043a\u043e\u0457
        \u0441\u043f\u0440\u0430\u0432\u0438\u00bb":1,"\u0427\u0435\u0440\u043a\u0430\u0441\u0438
        : \u0412\u0438\u0434\u0430\u0432\u0435\u0446\u044c \u0427\u0430\u0431\u0430\u043d\u0435\u043d\u043a\u043e
        \u042e.\u0410.":1,"\u0427\u0435\u0440\u043a\u0430\u0441\u0438 : \u0412\u0438\u0434\u0430\u0432\u0435\u0446\u044c
        \u0412\u043e\u0432\u0447\u043e\u043a \u041e.\u042e.":1,"\u0427\u0435\u0440\u043a\u0430\u0441\u0438
        : \u0412\u0438\u0434\u0430\u0432\u0435\u0446\u044c \u0412\u043e\u0432\u0447\u043e\u043a
        \u041e. \u042e.":1,"\u0427\u0435\u0440\u043a\u0430\u0441\u0438 : \u0411\u0440\u0430\u043c\u0430,
        \u0432\u0438\u0434\u0430\u0432\u0435\u0446\u044c \u0422\u0440\u0435\u0442\u044f\u043a\u043e\u0432
        \u041e. \u041c.":1,"\u0427\u0435\u0440\u043a\u0430\u0441\u0438 : \u0411\u0440\u0430\u043c\u0430,
        \u0432\u0438\u0434\u0430\u0432\u0435\u0446\u044c \u0412\u043e\u0432\u0447\u043e\u043a
        \u041e. \u042e.":1,"\u0427\u0435\u0440\u043a\u0430\u0441\u0438 : \u0411\u0440\u0430\u043c\u0430
        - \u0423\u043a\u0440\u0430\u0457\u043d\u0430,":1,"\u0427\u0413\u0418":1,"\u0426\u041d\u0418\u0418
        \u00ab\u041f\u0430\u0440\u0430\u0434\u0438\u0433\u043c\u0430\u00bb":1,"\u0424\u043e\u043d\u0434
        \u0440\u0430\u0437\u0432\u0438\u0442\u0438\u044f \u043a\u043e\u043d\u0444\u043b\u0438\u043a\u0442\u043e\u043b\u043e\u0433\u0438\u0438":1,"\u0424\u043e\u043d\u0434
        \u00ab\u0423\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442\u00bb":1,"\u0424\u043e\u043d\u0434
        \u00ab\u0420\u0443\u0441\u0441\u043a\u0438\u0435 \u0412\u0438\u0442\u044f\u0437\u0438\u00bb":1,"\u0424\u0435\u043d\u0456\u043a\u0441":1,"\u0424\u0435\u0434\u0435\u0440\u0430\u043b\u044c\u043d\u043e\u0435
        \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0435
        \u0431\u044e\u0434\u0436\u0435\u0442\u043d\u043e\u0435 \u0443\u0447\u0440\u0435\u0436\u0434\u0435\u043d\u0438\u0435
        \u043d\u0430\u0443\u043a\u0438 \u0422\u0438\u0445\u043e\u043e\u043a\u0435\u0430\u043d\u0441\u043a\u0438\u0439
        \u0438\u043d\u0441\u0442\u0438\u0442\u0443\u0442 \u0433\u0435\u043e\u0433\u0440\u0430\u0444\u0438\u0438
        \u0414\u0430\u043b\u044c\u043d\u0435\u0432\u043e\u0441\u0442\u043e\u0447\u043d\u043e\u0433\u043e
        \u043e\u0442\u0434\u0435\u043b\u0435\u043d\u0438\u044f \u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0439
        \u0430\u043a\u0430\u0434\u0435\u043c\u0438\u0438 \u043d\u0430\u0443\u043a":1,"\u0424\u0435\u0434\u0435\u0440\u0430\u043b\u044c\u043d\u043e\u0435
        \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0435
        \u0431\u044e\u0434\u0436\u0435\u0442\u043d\u043e\u0435 \u0443\u0447\u0440\u0435\u0436\u0434\u0435\u043d\u0438\u0435
        \u043d\u0430\u0443\u043a\u0438 \u0418\u043d\u0441\u0442\u0438\u0442\u0443\u0442
        \u043f\u0440\u043e\u0431\u043b\u0435\u043c \u0443\u043f\u0440\u0430\u0432\u043b\u0435\u043d\u0438\u044f
        \u0438\u043c. \u0412.\u0410. \u0422\u0440\u0430\u043f\u0435\u0437\u043d\u0438\u043a\u043e\u0432\u0430
        \u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0439 \u0430\u043a\u0430\u0434\u0435\u043c\u0438\u0438
        \u043d\u0430\u0443\u043a":1,"\u0424\u0435\u0434\u0435\u0440\u0430\u043b\u044c\u043d\u043e\u0435
        \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0435
        \u0431\u044e\u0434\u0436\u0435\u0442\u043d\u043e\u0435 \u0443\u0447\u0440\u0435\u0436\u0434\u0435\u043d\u0438\u0435
        \"\u0410\u043b\u0442\u0430\u0439\u0441\u043a\u0438\u0439 \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439
        \u043f\u0440\u0438\u0440\u043e\u0434\u043d\u044b\u0439 \u0431\u0438\u043e\u0441\u0444\u0435\u0440\u043d\u044b\u0439
        \u0437\u0430\u043f\u043e\u0432\u0435\u0434\u043d\u0438\u043a\"":1,"\u0424\u0435\u0434\u0435\u0440\u0430\u043b\u044c\u043d\u043e\u0435
        \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0435
        \u0431\u044e\u0434\u0436\u0435\u0442\u043d\u043e\u0435 \u043d\u0430\u0443\u0447\u043d\u043e\u0435
        \u0443\u0447\u0440\u0435\u0436\u0434\u0435\u043d\u0438\u0435 \"\u042d\u043a\u0441\u043f\u0435\u0440\u0442\u043d\u043e-\u0430\u043d\u0430\u043b\u0438\u0442\u0438\u0447\u0435\u0441\u043a\u0438\u0439
        \u0446\u0435\u043d\u0442\u0440\"":1,"\u0424\u0435\u0434\u0435\u0440\u0430\u043b\u044c\u043d\u043e\u0435
        \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0435
        \u0431\u044e\u0434\u0436\u0435\u0442\u043d\u043e\u0435 \u043d\u0430\u0443\u0447\u043d\u043e\u0435
        \u0443\u0447\u0440\u0435\u0436\u0434\u0435\u043d\u0438\u0435 \"\u0412\u0435\u0440\u0445\u043d\u0435\u0432\u043e\u043b\u0436\u0441\u043a\u0438\u0439
        \u0444\u0435\u0434\u0435\u0440\u0430\u043b\u044c\u043d\u044b\u0439 \u0430\u0433\u0440\u0430\u0440\u043d\u044b\u0439
        \u043d\u0430\u0443\u0447\u043d\u044b\u0439 \u0446\u0435\u043d\u0442\u0440\";
        \u041f\u0440\u0435\u0441\u0421\u0442\u043e":1,"\u0424\u0435\u0434\u0435\u0440\u0430\u043b\u044c\u043d\u043e\u0435
        \u0430\u0433\u0435\u043d\u0442\u0441\u0442\u0432\u043e \u043f\u043e \u043e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u043d\u0438\u044e
        \u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0439 \u0424\u0435\u0434\u0435\u0440\u0430\u0446\u0438\u0438
        \u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\u0441\u043a\u0438\u0439
        \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439
        \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442 \u0418\u043d\u0441\u0442\u0438\u0442\u0443\u0442
        \u043d\u0430\u0443\u043a \u043e \u0417\u0435\u043c\u043b\u0435":1,"\u0424\u0435\u0434\u0435\u0440.
        \u0433\u043e\u0441. \u0431\u044e\u0434\u0436\u0435\u0442. \u043d\u0430\u0443\u0447.
        \u0443\u0447\u0440\u0435\u0436\u0434\u0435\u043d\u0438\u0435 \u042f\u043a\u0443\u0442.
        \u043d\u0430\u0443\u0447.-\u0438\u0441\u0441\u043b\u0435\u0434. \u0438\u043d-\u0442
        \u0441\u0435\u043b. \u0445\u043e\u0437-\u0432\u0430 \u0438\u043c. \u041c.
        \u0413. \u0421\u0430\u0444\u0440\u043e\u043d\u043e\u0432\u0430":1,"\u0424\u041e\u041f
        \u0427\u0435\u0440\u043d\u044f\u0432\u0441\u044c\u043a\u0438\u0439 \u0414.\u041e.":1,"\u0424\u041e\u041f
        \u041f.\u0410 \u0406\u0432\u0430\u043d\u043e\u0432":1,"\u0424\u041e-\u041f
        \u0427\u0435\u0440\u043d\u044f\u0432\u0441\u044c\u043a\u0438\u0439 \u0414.\u041e.":1,"\u0424\u041b\u0418\u041d\u0422\u0410:
        \u041d\u0430\u0443\u043a\u0430":1,"\u0424\u0418\u0426 \u041a\u041d\u0426 \u0420\u0410\u041d":1,"\u0424\u0418\u0426
        \u00ab\u041a\u043e\u043b\u044c\u0441\u043a\u0438\u0439 \u043d\u0430\u0443\u0447\u043d\u044b\u0439
        \u0446\u0435\u043d\u0442\u0440\u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0439
        \u0430\u043a\u0430\u0434\u0435\u043c\u0438\u0438 \u043d\u0430\u0443\u043a\u00bb":1,"\u0424\u0413\u0423\u041f
        \u00ab\u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0438\u0439 \u0444\u0435\u0434\u0435\u0440\u0430\u043b\u044c\u043d\u044b\u0439
        \u044f\u0434\u0435\u0440\u043d\u044b\u0439 \u0446\u0435\u043d\u0442\u0440
        \u2013 \u0412\u0441\u0435\u0440\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0438\u0439
        \u043d\u0430\u0443\u0447\u043d\u043e-\u0438\u0441\u0441\u043b\u0435\u0434\u043e\u0432\u0430\u0442\u0435\u043b\u044c\u0441\u043a\u0438\u0439
        \u0438\u043d\u0441\u0442\u0438\u0442\u0443\u0442 \u044d\u043a\u0441\u043f\u0435\u0440\u0438\u043c\u0435\u043d\u0442\u0430\u043b\u044c\u043d\u043e\u0439
        \u0444\u0438\u0437\u0438\u043a\u0438\u00bb":1,"\u0424\u0413\u0423\u041f \u00ab\u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0438\u0439
        \u0444\u0435\u0434\u0435\u0440\u0430\u043b\u044c\u043d\u044b\u0439 \u044f\u0434\u0435\u0440\u043d\u044b\u0439
        \u0446\u0435\u043d\u0442\u0440 - \u0412\u041d\u0418\u0418\u042d\u0424\u00bb":1,"\u0424\u0413\u0411\u041e\u0423
        \u0412\u041f\u041e \u00ab\u0427\u0435\u0440\u0435\u043f\u043e\u0432\u0435\u0446\u043a\u0438\u0439
        \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439
        \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442\u00bb":1,"\u0424\u0413\u0411\u041e\u0423
        \u0412\u041e \u0411\u0413\u041c\u0423 \u041c\u0438\u043d\u0437\u0434\u0440\u0430\u0432\u0430
        \u0420\u043e\u0441\u0441\u0438\u0438":1,"\u0424\u0413\u0411\u041d\u0423 \u042f\u041d\u0418\u0418\u0421\u0425":1,"\u0424\u0413\u0411\u041d\u0423
        \u00ab\u041a\u0443\u0440\u0441\u043a\u0438\u0439 \u0444\u0435\u0434\u0435\u0440\u0430\u043b\u044c\u043d\u044b\u0439
        \u0430\u0433\u0440\u0430\u0440\u043d\u044b\u0439 \u043d\u0430\u0443\u0447\u043d\u044b\u0439
        \u0446\u0435\u043d\u0442\u0440\u00bb":1,"\u0424\u0413\u0411\u041d\u0423 \u00ab\u0410\u043d\u0430\u043b\u0438\u0442\u0438\u0447\u0435\u0441\u043a\u0438\u0439
        \u0446\u0435\u043d\u0442\u0440\u00bb":1,"\u0423\u0444\u0438\u043c\u0441\u043a.
        \u0433\u043e\u0441. \u0430\u0432\u0438\u0430\u0446. \u0442\u0435\u0445\u043d.
        \u0443\u043d-\u0442. \u2013 \u0420\u043e\u0441\u0442\u043e\u0432 \u043d\/\u0414.:
        \u00ab\u0424\u0435\u043d\u0438\u043a\u0441\u00bb":1,"\u0423\u0440\u0413\u0410\u0425\u0423":1,"\u0423\u043d\u0456\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442
        \u0456\u043c\u0435\u043d\u0456 \u0410\u043b\u044c\u0444\u0440\u0435\u0434\u0430
        \u041d\u043e\u0431\u0435\u043b\u044f":1,"\u0423\u043d\u0456\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442
        \u0413\u0440\u0438\u0433\u043e\u0440\u0456\u044f \u0421\u043a\u043e\u0432\u043e\u0440\u043e\u0434\u0438
        \u0432 \u041f\u0435\u0440\u0435\u044f\u0441\u043b\u0430\u0432\u0456":1,"\u0422\u044e\u043c
        \u0413\u041c\u0423":1,"\u0422\u043e\u043c\u0441\u043a: \u0422\u041c\u041b-\u041f\u0440\u0435\u0441\u0441":1,"\u0422\u0438\u0445\u043e\u043e\u043a\u0435\u0430\u043d\u0441\u043a\u0438\u0439
        \u0438\u043d\u0441\u0442\u0438\u0442\u0443\u0442 \u0433\u0435\u043e\u0433\u0440\u0430\u0444\u0438\u0438
        \u0414\u0412\u041e \u0420\u0410\u041d":1,"\u0422\u0437\u041e\u0412 \"\u0417\u0423\u041a\u0426\"":1,"\u0422\u0435\u0445\u043d\u0438\u0447\u0435\u0441\u043a\u043e\u0433\u043e
        \u0438\u043d\u0441\u0442\u0438\u0442\u0443\u0442\u0430 (\u0444\u0438\u043b\u0438\u0430\u043b\u0430)
        \u0421\u0412\u0424\u0423":1,"\u0422\u0435\u0440\u043d\u043e\u043f\u0456\u043b\u044c
        : \u0424\u041e\u041f \u041e\u0441\u0430\u0434\u0446\u0430 \u042e. \u0412.":1,"\u0422\u0432\u0435\u0440\u044c:
        \u0422\u0432\u0435\u0440\u0441\u043a\u0430\u044f \u0413\u0421\u0425\u0410":1,"\u0422\u0430\u043b\u043a\u043e\u043c":1,"\u0422\u041e\u0420\u0423\u0421
        \u041f\u0420\u0415\u0421\u0421":1,"\u0422\u041e\u0412 \u00ab\u0422\u0432\u043e\u0440\u0438\u00bb":1,"\u0422\u041e\u0412
        \u00ab\u041d\u0412\u041f \u00ab\u0406\u043d\u0442\u0435\u0440\u0441\u0435\u0440\u0432\u0456\u0441\u00bb":1,"\u0422\u041c\u041b-\u041f\u0440\u0435\u0441\u0441":1,"\u0422-\u0432\u043e
        \u00ab\u0417\u043d\u0430\u043d\u043d\u044f\u00bb \u0423\u0420\u0421\u0420":1,"\u0421\u0442\u0430\u0432\u0440\u043e\u043f\u043e\u043b\u044c\u0441\u043a\u0438\u0439
        \u0444\u0438\u043b\u0438\u0430\u043b \u0420\u0410\u041d\u0425\u0438\u0413\u0421,
        2014":1,"\u0421\u0442\u0430\u0432\u0440\u043e\u043f\u043e\u043b\u044c: \u0418\u0437\u0434-\u0432\u043e
        \u0421\u0442\u0413\u041c\u0410":1,"\u0421\u0438\u043c\u0444\u0435\u0440\u043e\u043f\u043e\u043b\u044c":1,"\u0421\u0438\u0431\u0438\u0440\u0441\u043a\u0438\u0439
        \u0444\u0435\u0434\u0435\u0440\u0430\u043b\u044c\u043d\u044b\u0439 \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442":1,"\u0421\u0438\u0431.
        \u0433\u043e\u0441. \u0443\u043d-\u0442 \u043d\u0430\u0443\u043a\u0438 \u0438
        \u0442\u0435\u0445\u043d\u043e\u043b\u043e\u0433\u0438\u0439 \u2013 \u041a\u0440\u0430\u0441\u043d\u043e\u044f\u0440\u0441\u043a":1,"\u0421\u0430\u0445\u0430\u043b\u0438\u043d\u0441\u043a\u0438\u0439
