        \u0438 \u0438\u0441\u0441\u043b\u0435\u0434\u043e\u0432\u0430\u043d\u0438\u044f
        \u043a\u043e\u043d\u0444\u043b\u0438\u043a\u0442\u043e\u0432":1,"\u0418\u043d\u0441\u0442\u0438\u0442\u0443\u0442
        \u043a\u043e\u043d\u0441\u0443\u043b\u044c\u0442\u0438\u0440\u043e\u0432\u0430\u043d\u0438\u044f
        \u0438 \u0441\u0438\u0441\u0442\u0435\u043c\u043d\u044b\u0445 \u0440\u0435\u0448\u0435\u043d\u0438\u0439,
        \u041e\u0431\u0449\u0435\u0440\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0430\u044f
        \u043f\u0440\u043e\u0444\u0435\u0441\u0441\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u0430\u044f
        \u043f\u0441\u0438\u0445\u043e\u0442\u0435\u0440\u0430\u043f\u0435\u0432\u0442\u0438\u0447\u0435\u0441\u043a\u0430\u044f
        \u043b\u0438\u0433\u0430":1,"\u0418\u043d\u0441\u0442\u0438\u0442\u0443\u0442
        \u042d\u043a\u043e\u043d\u043e\u043c\u0438\u043a\u0438 \u041d\u0410\u041d
        \u0410\u0437\u0435\u0440\u0431\u0430\u0439\u0434\u0436\u0430\u043d\u0430.
        \u0411\u0430\u043a\u0443. \u042d\u043b":1,"\u0418\u043d\u043d\u043e\u0432\u0430\u0446\u0438\u043e\u043d\u043d\u043e\u0435
        \u043c\u0430\u0448\u0438\u043d\u043e\u0441\u0442\u0440\u043e\u0435\u043d\u0438\u0435":1,"\u0418\u0437\u0434\u0430\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e:
        \u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\u0441\u043a\u0438\u0439
        \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442 \u041c\u0438\u043d\u0438\u0441\u0442\u0435\u0440\u0441\u0442\u0432\u0430
        \u0432\u043d\u0443\u0442\u0440\u0435\u043d\u043d\u0438\u0445 \u0434\u0435\u043b
        \u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0439 \u0424\u0435\u0434\u0435\u0440\u0430\u0446\u0438\u0438":1,"\u0418\u0437\u0434\u0430\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e
        \u044e\u0440\u0438\u0434\u0438\u0447\u0435\u0441\u043a\u043e\u0433\u043e \u0444\u0430\u043a\u0443\u043b\u044c\u0442\u0435\u0442\u0430
        \u0421\u041f\u0431\u0413\u0423":1,"\u0418\u0437\u0434\u0430\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e
        \u0422\u043e\u043c\u0441\u043a\u043e\u0433\u043e \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442\u0430":1,"\u0418\u0437\u0434\u0430\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e
        \u0422\u043e\u043c\u0441\u043a\u043e\u0433\u043e \u043f\u043e\u043b\u0438\u0442\u0435\u0445\u043d\u0438\u0447\u0435\u0441\u043a\u043e\u0433\u043e
        \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442\u0430":1,"\u0418\u0437\u0434\u0430\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e
        \u041f\u043e\u043b\u0438\u0442\u0435\u0445\u043d\u0438\u0447\u0435\u0441\u043a\u043e\u0433\u043e
        \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442\u0430,
        \u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433":1,"\u0418\u0437\u0434\u0430\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e
        \u041f\u043e\u043b\u0438\u0442\u0435\u0445\u043d\u0438\u0447\u0435\u0441\u043a\u043e\u0433\u043e
        \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442\u0430":1,"\u0418\u0437\u0434\u0430\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e
        \u041d\u043e\u0432\u043e\u0441\u0438\u0431\u0438\u0440\u0441\u043a\u043e\u0433\u043e
        \u044e\u0440\u0438\u0434\u0438\u0447\u0435\u0441\u043a\u043e\u0433\u043e \u0438\u043d\u0441\u0442\u0438\u0442\u0443\u0442\u0430
        (\u0444\u0438\u043b\u0438\u0430\u043b\u0430) \u041d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u043e\u0433\u043e
        \u0438\u0441\u0441\u043b\u0435\u0434\u043e\u0432\u0430\u0442\u0435\u043b\u044c\u0441\u043a\u043e\u0433\u043e
        \u0422\u043e\u043c\u0441\u043a\u043e\u0433\u043e \u0433\u0443\u043c\u0430\u043d\u0438\u0442\u0430\u0440\u043d\u043e\u0433\u043e
        \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442\u0430":1,"\u0418\u0437\u0434\u0430\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e
        \u041c\u0418\u041d\u0426 \"\u041d\u043e\u0431\u0435\u043b\u0438\u0441\u0442\u0438\u043a\u0430\"":1,"\u0418\u0437\u0434\u0430\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e
        \u041a\u0430\u0437\u0430\u043d\u0441\u043a\u043e\u0433\u043e \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442\u0430":1,"\u0418\u0437\u0434\u0430\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e
        \u0418\u0421\u0421\u0422\u042d":1,"\u0418\u0437\u0434\u0430\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e
        \u00ab\u041f\u043e\u043b\u0438\u0442\u0435\u0445\u043d\u0438\u043a\u0430\u00bb":1,"\u0418\u0437\u0434\u0430\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e
        \u00ab\u041d\u0430\u0443\u0447\u043d\u043e-\u0438\u0441\u0441\u043b\u0435\u0434\u043e\u0432\u0430\u0442\u0435\u043b\u044c\u0441\u043a\u0438\u0435
        \u043f\u0443\u0431\u043b\u0438\u043a\u0430\u0446\u0438\u0438\u00bb":1,"\u0418\u0437\u0434\u0430\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e
        \u00ab\u041d\u0430\u0443\u0447\u043d\u0430\u044f \u043a\u043d\u0438\u0433\u0430\u00bb":1,"\u0418\u0437\u0434\u0430\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e
        \"\u041d\u0430\u0443\u043a\u0430\"":1,"\u0418\u0437\u0434\u0430\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e
        \"\u041a\u043e\u043b\u043e\u0441\u0421\"":1,"\u0418\u0437\u0434\u0430\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e
        \"\u0412\u0435\u0442\u0435\u0440\"":1,"\u0418\u0437\u0434\u0430\u0442\u0435\u043b\u044c\u0441\u043a\u0438\u0439
        \u0446\u0435\u043d\u0442\u0440 \u00ab\u041d\u0430\u0443\u043a\u0430 \u0438
        \u043f\u0440\u0430\u043a\u0442\u0438\u043a\u0430\u00bb":1,"\u0418\u0437\u0434\u0430\u0442\u0435\u043b\u044c\u0441\u043a\u0438\u0439
        \u0434\u043e\u043c \u0412\u0438\u0434\u0430\u0440-\u041c":1,"\u0418\u0437\u0434\u0430\u0442\u0435\u043b\u044c\u0441\u043a\u0438\u0439
        \u0434\u043e\u043c \u0410\u043a\u0430\u0434\u0435\u043c\u0438\u0438 \u0415\u0441\u0442\u0435\u0441\u0442\u0432\u043e\u0437\u043d\u0430\u043d\u0438\u044f,":1,"\u0418\u0437\u0434\u0430\u0442\u0435\u043b\u044c\u0441\u043a\u0438\u0439
        \u0434\u043e\u043c \u0410\u043a\u0430\u0434\u0435\u043c\u0438\u0438 \u0415\u0441\u0442\u0435\u0441\u0442\u0432\u043e
        \u0437\u043d\u0430\u043d\u0438\u044f,":1,"\u0418\u0437\u0434\u0430\u0442\u0435\u043b\u044c\u0441\u043a\u0438\u0439
        \u0434\u043e\u043c \"\u0420\u0443\u0441\u0441\u043a\u0438\u0439 \u0432\u0440\u0430\u0447\"":1,"\u0418\u0437\u0434\u0430\u0442\u0435\u043b\u044c\u0441\u043a\u0438\u0439
        \u0414\u043e\u043c \u042f\u0421\u041a":1,"\u0418\u0437\u0434-\u0432\u043e
        \u0424\u0413\u0411\u0423\u041d \u0418\u043d\u0441\u0442\u0438\u0442\u0443\u0442
        \u043c\u0435\u0440\u0437\u043b\u043e\u0442\u043e\u0432\u0435\u0434\u0435\u043d\u0438\u044f
        \u0438\u043c. \u041f. \u0418. \u041c\u0435\u043b\u044c\u043d\u0438\u043a\u043e\u0432\u0430
        \u0421\u041e \u0420\u0410\u041d":1,"\u0418\u0437\u0434-\u0432\u043e \u0422\u0431\u0438\u043b\u0438\u0441\u043a\u043e\u0433\u043e
        \u0443\u043d-\u0442\u0430":1,"\u0418\u0437\u0434-\u0432\u043e \u0421\u041f\u0425\u0424\u0410":1,"\u0418\u0437\u0434-\u0432\u043e
        \u041f\u0440\u0438\u0434\u043d\u0435\u0441\u0442\u0440\u043e\u0432\u0441\u043a\u043e\u0433\u043e
        \u0443\u043d-\u0442\u0430":1,"\u0418\u0437\u0434-\u0432\u043e \u041a\u0430\u0437\u0430\u043d\u0441\u043a\u043e\u0433\u043e
        \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442\u0430":1,"\u0418\u0437\u0434-\u0432\u043e
        \u0412\u043e\u043b\u0413\u0423,":1,"\u0418\u0437\u0434-\u0432\u043e \u0412\u043b\u0430\u0434\u0438\u043c\u0438\u0440\u0441\u043a\u043e\u0433\u043e
        \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0433\u043e
        \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442\u0430":1,"\u0418\u0426
        \"\u041d\u0430\u0443\u043a\u0430 \u0438 \u043f\u0440\u0430\u043a\u0442\u0438\u043a\u0430\"":1,"\u0418\u0422
        \u00ab\u0410\u0420\u0418\u0410\u041b\u00bb":1,"\u0418\u0420\u041a\u0423\u0422\u0421\u041a\u0418\u0419
        \u0413\u041e\u0421\u0423\u0414\u0410\u0420\u0421\u0422\u0412\u0415\u041d\u041d\u042b\u0419
        \u0423\u041d\u0418\u0412\u0415\u0420\u0421\u0418\u0422\u0415\u0422":1,"\u0418\u041f\u041a
        \u0420\u0424\u042f\u0426-\u0412\u041d\u0418\u0418\u042d\u0424":1,"\u0418\u041f\u041a
        \u00ab\u041f\u0440\u0430\u0432\u043e\u00bb":1,"\u0418\u0417\u0412\u0415\u0421\u0422\u0418\u042f,
        \u0440\u0430\u0437\u0434\u0435\u043b \u00ab\u041d\u0435\u0444\u0442\u0435\u0433\u0430\u0437\u043e\u0434\u043e\u0431\u044b\u0447\u0430\u00bb.
        \u041c\u043e\u0441\u043a\u0432\u0430. \u21164. 2003. 0,4 \u043f.\u043b.":1,"\u0418\u0414
        \u0411\u0438\u0431\u043b\u0438\u043e\u0433\u0440\u0430\u0444":1,"\u0418\u0414
        \u0410\u043a\u0430\u0434\u0435\u043c\u0438\u044f \u0415\u0441\u0442\u0435\u0441\u0442\u0432\u043e\u0437\u043d\u0430\u043d\u0438\u044f":1,"\u0418\u0414
        \u00ab\u0410\u043a\u0430\u0434\u0435\u043c\u0438\u044f \u0415\u0441\u0442\u0435\u0441\u0442\u0432\u043e\u0437\u043d\u0430\u043d\u0438\u044f\u00bb":1,"\u0418\u0411
        \u0424\u0418\u0426 \u041a\u043e\u043c\u0438 \u041d\u0426 \u0423\u0440\u041e
        \u0420\u0410\u041d":1,"\u0417\u043d\u0430\u043d\u043d\u044f":1,"\u0416\u0443\u0440\u0444\u043e\u043d\u0434;
        \u0412\u0430\u0445\u043c\u0456\u0441\u0442\u0440\u043e\u0432 \u041e. \u0404.":1,"\u0416\u0443\u0440\u043d\u0430\u043b
        \u042d\u043a\u043e\u043d\u043e\u043c\u0438\u043a\u0430 \u0438 \u043f\u0440\u0435\u0434\u043f\u0440\u0438\u043d\u0438\u043c\u0430\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e.":1,"\u0416\u0438\u0442\u043e\u043c\u0438\u0440:
        \u0432\u0438\u0434-\u0432\u043e \u0424\u041e\u041f \"\u041e. \u041e. \u0404\u0432\u0435\u043d\u043e\u043a\"":1,"\u0415\u0432\u0440\u043e\u043f\u0435\u0439\u0441\u043a\u0430\u044f
        \u043d\u0430\u0443\u0447\u043d\u0430\u044f \u043f\u043b\u0430\u0442\u0444\u043e\u0440\u043c\u0430":1,"\u0414\u0456\u043e\u043d\u0456\u0441
        (\u0424\u041e-\u041f \u0427\u0435\u0440\u043d\u044f\u0432\u0441\u044c\u043a\u0438\u0439
        \u0414.\u041e.)":1,"\u0414\u0440\u0456\u0430\u043d\u0442":1,"\u0414\u0440\u0443\u043a\u0430\u0440\u043d\u044f
        \u0421\u041f\u0414 \u0429\u0435\u0440\u0431\u0435\u043d\u043e\u043a \u0421.
        \u0413.":1,"\u0414\u043e\u043d\u0435\u0446\u043a : \u0421\u0432\u0456\u0442
        \u043a\u043d\u0438\u0433\u0438":1,"\u0414\u043d\u0456\u043f\u0440\u043e\u043f\u0435\u0442\u0440\u043e\u0432\u0441\u044c\u043a\u0430
        \u043e\u0431\u043b\u0430\u0441\u043d\u0430 \u0440\u0435\u0434\u043a\u043e\u043b\u0435\u0433\u0456\u044f
        \u043f\u043e \u043f\u0456\u0434\u0433\u043e\u0442\u043e\u0432\u0446\u0456
        \u0439 \u0432\u0438\u0434\u0430\u043d\u043d\u044e \u0442\u0435\u043c\u0430\u0442\u0438\u0447\u043d\u043e\u0457
        \u0441\u0435\u0440\u0456\u0457 \u043a\u043d\u0438\u0433 \u00ab\u0420\u0435\u0430\u0431\u0456\u043b\u0456\u0442\u043e\u0432\u0430\u043d\u0456
        \u0456\u0441\u0442\u043e\u0440\u0456\u0454\u044e ; \u0432\u0438\u0434-\u0432\u043e
        \u00ab\u041c\u043e\u043d\u043e\u043b\u0456\u0442\u00bb":1,"\u0414\u043d\u0456\u043f\u0440\u043e\u0432\u0441\u044c\u043a\u0438\u0439
        \u043d\u0430\u0446\u0456\u043e\u043d\u0430\u043b\u044c\u043d\u0438\u0439 \u0443\u043d\u0456\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442
        \u0437\u0430\u043b\u0456\u0437\u043d\u0438\u0447\u043d\u043e\u0433\u043e \u0442\u0440\u0430\u043d\u0441\u043f\u043e\u0440\u0442\u0443
        \u0456\u043c\u0435\u043d\u0456 \u0430\u043a\u0430\u0434\u0435\u043c\u0456\u043a\u0430
        \u0412. \u041b\u0430\u0437\u0430\u0440\u044f\u043d\u0430":1,"\u0414\u043d\u0456\u043f\u0440\u043e
        \u00ab\u0421\u0435\u0440\u0435\u0434\u043d\u044f\u043a \u0422.\u041a.\u00bb":1,"\u0414\u0435\u0440\u0436\u0430\u0432\u043d\u0435
        \u0432\u0438\u0434\u0430\u0432\u043d\u0438\u0446\u0442\u0432\u043e \u0423\u043a\u0440\u0430\u0457\u043d\u0438":1,"\u0414\u0435\u0440\u0436\u0430\u0432\u043d\u0430
        \u043d\u0430\u0443\u043a\u043e\u0432\u0430 \u0443\u0441\u0442\u0430\u043d\u043e\u0432\u0430
        \u00ab\u041d\u0430\u0443\u043a\u043e\u0432\u043e-\u043f\u0440\u0430\u043a\u0442\u0438\u0447\u043d\u0438\u0439
